";'),('en','messages:limitreport-cputime-value','s:31:\"$1 {{PLURAL:$1|second|seconds}}\";'),('en','messages:limitreport-walltime','s:15:\"Real time usage\";'),('en','messages:limitreport-walltime-value','s:31:\"$1 {{PLURAL:$1|second|seconds}}\";'),('en','messages:limitreport-ppvisitednodes','s:31:\"Preprocessor visited node count\";'),('en','messages:limitreport-ppvisitednodes-value','s:5:\"$1/$2\";'),('en','messages:limitreport-ppgeneratednodes','s:33:\"Preprocessor generated node count\";'),('en','messages:limitreport-ppgeneratednodes-value','s:5:\"$1/$2\";'),('en','messages:limitreport-postexpandincludesize','s:24:\"Post-expand include size\";'),('en','messages:limitreport-postexpandincludesize-value','s:30:\"$1/$2 {{PLURAL:$2|byte|bytes}}\";'),('en','messages:limitreport-templateargumentsize','s:22:\"Template argument size\";'),('en','messages:limitreport-templateargumentsize-value','s:30:\"$1/$2 {{PLURAL:$2|byte|bytes}}\";'),('en','messages:limitreport-expansiondepth','s:23:\"Highest expansion depth\";'),('en','messages:limitreport-expansiondepth-value','s:5:\"$1/$2\";'),('en','messages:limitreport-expensivefunctioncount','s:31:\"Expensive parser function count\";'),('en','messages:limitreport-expensivefunctioncount-value','s:5:\"$1/$2\";'),('en','messages:expandtemplates','s:16:\"Expand templates\";'),('en','messages:expand_templates_intro','s:295:\"This special page takes text and expands all templates in it recursively.\nIt also expands supported parser functions like\n<code><nowiki>{{</nowiki>#language:}}</code> and variables like\n<code><nowiki>{{</nowiki>CURRENTDAY}}</code>.\nIn fact, it expands pretty much everything in double-braces.\";'),('en','messages:expand_templates_title','s:42:\"Context title, for {{FULLPAGENAME}}, etc.:\";'),('en','messages:expand_templates_input','s:11:\"Input text:\";'),('en','messages:expand_templates_output','s:6:\"Result\";'),('en','messages:expand_templates_xml_output','s:10:\"XML output\";'),('en','messages:expand_templates_html_output','s:15:\"Raw HTML output\";'),('en','messages:expand_templates_ok','s:2:\"OK\";'),('en','messages:expand_templates_remove_comments','s:15:\"Remove comments\";'),('en','messages:expand_templates_remove_nowiki','s:32:\"Suppress <nowiki> tags in result\";'),('en','messages:expand_templates_generate_xml','s:19:\"Show XML parse tree\";'),('en','messages:expand_templates_generate_rawhtml','s:13:\"Show raw HTML\";'),('en','messages:expand_templates_preview','s:7:\"Preview\";'),('en','messages:expand_templates_preview_fail_html','s:318:\"<em>Because {{SITENAME}} has raw HTML enabled and there was a loss of session data, the preview is hidden as a precaution against JavaScript attacks.</em>\n\n<strong>If this is a legitimate preview attempt, please try again.</strong>\nIf it still does not work, try [[Special:UserLogout|logging out]] and logging back in.\";'),('en','messages:expand_templates_preview_fail_html_anon','s:253:\"<em>Because {{SITENAME}} has raw HTML enabled and you are not logged in, the preview is hidden as a precaution against JavaScript attacks.</em>\n\n<strong>If this is a legitimate preview attempt, please [[Special:UserLogin|log in]] and try again.</strong>\";'),('en','messages:pagelanguage','s:22:\"Page language selector\";'),('en','messages:pagelang-name','s:4:\"Page\";'),('en','messages:pagelang-language','s:8:\"Language\";'),('en','messages:pagelang-use-default','s:20:\"Use default language\";'),('en','messages:pagelang-select-lang','s:15:\"Select language\";'),('en','messages:right-pagelang','s:20:\"Change page language\";'),('en','messages:action-pagelang','s:24:\"change the page language\";'),('en','messages:log-name-pagelang','s:19:\"Change language log\";'),('en','messages:log-description-pagelang','s:43:\"This is a log of changes in page languages.\";'),('en','messages:logentry-pagelang-pagelang','s:60:\"$1 {{GENDER:$2|changed}} page language for $3 from $4 to $5.\";'),('en','messages:default-skin-not-found','s:1610:\"Whoops! The default skin for your wiki, defined in <code dir=\"ltr\">$wgDefaultSkin</code> as <code>$1</code>, is not available.\n\nYour installation seems to include the following skins. See [https://www.mediawiki.org/wiki/Manual:Skin_configuration Manual: Skin configuration] for information how to enable them and choose the default.\n\n$2\n\n; If you have just installed MediaWiki:\n: You probably installed from git, or directly from the source code using some other method. This is expected. Try installing some skins from [https://www.mediawiki.org/wiki/Category:All_skins mediawiki.org\'s skin directory], by:\n:* Downloading the [https://www.mediawiki.org/wiki/Download tarball installer], which comes with several skins and extensions. You can copy and paste the <code>skins/</code> directory from it.\n:* Downloading individual skin tarballs from [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* Cloning one of the <code>mediawiki/skins/*</code> repositories via git into the <code dir=\"ltr\">skins/</code> directory of your MediaWiki installation.\n: Doing this should not interfere with your git repository if you\'re a MediaWiki developer.\n\n; If you have just upgraded MediaWiki:\n: MediaWiki 1.24 and newer no longer automatically enables installed skins (see [https://www.mediawiki.org/wiki/Manual:Skin_autodiscovery Manual: Skin autodiscovery]). You can paste the following lines into <code>LocalSettings.php</code> to enable all currently installed skins:\n\n<pre dir=\"ltr\">$3</pre>\n\n; If you have just modified <code>LocalSettings.php</code>:\n: Double-check the skin names for typos.\";'),('en','messages:default-skin-not-found-no-skins','s:1212:\"Whoops! The default skin for your wiki, defined in <code>$wgDefaultSkin</code> as <code>$1</code>, is not available.\n\nYou have no installed skins.\n\n; If you have just installed or upgraded MediaWiki:\n: You probably installed from git, or directly from the source code using some other method. This is expected. MediaWiki 1.24 and newer doesn\'t include any skins in the main repository. Try installing some skins from [https://www.mediawiki.org/wiki/Category:All_skins mediawiki.org\'s skin directory], by:\n:* Downloading the [https://www.mediawiki.org/wiki/Download tarball installer], which comes with several skins and extensions. You can copy and paste the <code>skins/</code> directory from it.\n:* Downloading individual skin tarballs from [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* Cloning one of the <code>mediawiki/skins/*</code> repositories via git into the <code dir=\"ltr\">skins/</code> directory of your MediaWiki installation.\n: Doing this should not interfere with your git repository if you\'re a MediaWiki developer. See [https://www.mediawiki.org/wiki/Manual:Skin_configuration Manual: Skin configuration] for information how to enable skins and choose the default.\n\";'),('en','messages:default-skin-not-found-row-enabled','s:32:\"* <code>$1</code> / $2 (enabled)\";'),('en','messages:default-skin-not-found-row-disabled','s:39:\"* <code>$1</code> / $2 (\'\'\'disabled\'\'\')\";'),('en','messages:mediastatistics','s:16:\"Media statistics\";'),('en','messages:mediastatistics-summary','s:138:\"Statistics about uploaded file types. This only includes the most recent version of a file. Old or deleted versions of files are excluded.\";'),('en','messages:mediastatistics-nfiles','s:8:\"$1 ($2%)\";'),('en','messages:mediastatistics-nbytes','s:40:\"{{PLURAL:$1|$1 byte|$1 bytes}} ($2; $3%)\";'),('en','messages:mediastatistics-table-mimetype','s:9:\"MIME type\";'),('en','messages:mediastatistics-table-extensions','s:19:\"Possible extensions\";'),('en','messages:mediastatistics-table-count','s:15:\"Number of files\";'),('en','messages:mediastatistics-table-totalbytes','s:13:\"Combined size\";'),('en','messages:mediastatistics-header-unknown','s:7:\"Unknown\";'),('en','messages:mediastatistics-header-bitmap','s:13:\"Bitmap images\";'),('en','messages:mediastatistics-header-drawing','s:24:\"Drawings (vector images)\";'),('en','messages:mediastatistics-header-audio','s:5:\"Audio\";'),('en','messages:mediastatistics-header-video','s:6:\"Videos\";'),('en','messages:mediastatistics-header-multimedia','s:10:\"Rich media\";'),('en','messages:mediastatistics-header-office','s:6:\"Office\";'),('en','messages:mediastatistics-header-text','s:7:\"Textual\";'),('en','messages:mediastatistics-header-executable','s:11:\"Executables\";'),('en','messages:mediastatistics-header-archive','s:18:\"Compressed formats\";'),('en','messages:json-warn-trailing-comma','s:65:\"$1 trailing {{PLURAL:$1|comma was|commas were}} removed from JSON\";'),('en','messages:json-error-unknown','s:44:\"There was a problem with the JSON. Error: $1\";'),('en','messages:json-error-depth','s:41:\"The maximum stack depth has been exceeded\";'),('en','messages:json-error-state-mismatch','s:25:\"Invalid or malformed JSON\";'),('en','messages:json-error-ctrl-char','s:53:\"Control character error, possibly incorrectly encoded\";'),('en','messages:json-error-syntax','s:12:\"Syntax error\";'),('en','messages:json-error-utf8','s:56:\"Malformed UTF-8 characters, possibly incorrectly encoded\";'),('en','messages:json-error-recursion','s:59:\"One or more recursive references in the value to be encoded\";'),('en','messages:json-error-inf-or-nan','s:56:\"One or more NAN or INF values in the value to be encoded\";'),('en','messages:json-error-unsupported-type','s:50:\"A value of a type that cannot be encoded was given\";'),('en','messages:headline-anchor-title','s:20:\"Link to this section\";'),('en','messages:special-characters-group-latin','s:5:\"Latin\";'),('en','messages:special-characters-group-latinextended','s:14:\"Latin extended\";'),('en','messages:special-characters-group-ipa','s:3:\"IPA\";'),('en','messages:special-characters-group-symbols','s:7:\"Symbols\";'),('en','messages:special-characters-group-greek','s:5:\"Greek\";'),('en','messages:special-characters-group-cyrillic','s:8:\"Cyrillic\";'),('en','messages:special-characters-group-arabic','s:6:\"Arabic\";'),('en','messages:special-characters-group-arabicextended','s:15:\"Arabic extended\";'),('en','messages:special-characters-group-persian','s:7:\"Persian\";'),('en','messages:special-characters-group-hebrew','s:6:\"Hebrew\";'),('en','messages:special-characters-group-bangla','s:6:\"Bangla\";'),('en','messages:special-characters-group-tamil','s:5:\"Tamil\";'),('en','messages:special-characters-group-telugu','s:6:\"Telugu\";'),('en','messages:special-characters-group-sinhala','s:7:\"Sinhala\";'),('en','messages:special-characters-group-gujarati','s:8:\"Gujarati\";'),('en','messages:special-characters-group-devanagari','s:10:\"Devanagari\";'),('en','messages:special-characters-group-thai','s:4:\"Thai\";'),('en','messages:special-characters-group-lao','s:3:\"Lao\";'),('en','messages:special-characters-group-khmer','s:5:\"Khmer\";'),('en','messages:special-characters-title-endash','s:7:\"en dash\";'),('en','messages:special-characters-title-emdash','s:7:\"em dash\";'),('en','messages:special-characters-title-minus','s:10:\"minus sign\";'),('en','messages:apihelp-main-description','s:976:\"<div class=\"hlist plainlinks api-main-links\">\n* [[mw:API:Main_page|Documentation]]\n* [[mw:API:FAQ|FAQ]]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api Mailing list]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce API Announcements]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Bugs & requests]\n</div>\n<strong>Status:</strong> All features shown on this page should be working, but the API is still in active development, and may change at any time. Subscribe to [https://lists.wikimedia.org/pipermail/mediawiki-api-announce/ the mediawiki-api-announce mailing list] for notice of updates.\n\n<strong>Erroneous requests:</strong> When erroneous requests are sent to the API, an HTTP header will be sent with the key \"MediaWiki-API-Error\" and then both the value of the header and the error code sent back will be set to the same value. For more information see [[mw:API:Errors_and_warnings|API: Errors and warnings]].\";'),('en','messages:apihelp-main-param-action','s:24:\"Which action to perform.\";'),('en','messages:apihelp-main-param-format','s:25:\"The format of the output.\";'),('en','messages:apihelp-main-param-maxlag','s:469:\"Maximum lag can be used when MediaWiki is installed on a database replicated cluster. To save actions causing any more site replication lag, this parameter can make the client wait until the replication lag is less than the specified value. In case of excessive lag, error code <samp>maxlag</samp> is returned with a message like <samp>Waiting for $host: $lag seconds lagged</samp>.<br />See [[mw:Manual:Maxlag_parameter|Manual: Maxlag parameter]] for more information.\";'),('en','messages:apihelp-main-param-smaxage','s:83:\"Set the <code>s-maxage</code> header to this many seconds. Errors are never cached.\";'),('en','messages:apihelp-main-param-maxage','s:82:\"Set the <code>max-age</code> header to this many seconds. Errors are never cached.\";'),('en','messages:apihelp-main-param-assert','s:99:\"Verify the user is logged in if set to <kbd>user</kbd>, or has the bot userright if <kbd>bot</kbd>.\";'),('en','messages:apihelp-main-param-requestid','s:91:\"Any value given here will be included in the response. May be used to distinguish requests.\";'),('en','messages:apihelp-main-param-servedby','s:60:\"Include the hostname that served the request in the results.\";'),('en','messages:apihelp-main-param-curtimestamp','s:44:\"Include the current timestamp in the result.\";'),('en','messages:apihelp-main-param-origin','s:660:\"When accessing the API using a cross-domain AJAX request (CORS), set this to the originating domain. This must be included in any pre-flight request, and therefore must be part of the request URI (not the POST body). This must match one of the origins in the <code>Origin</code> header exactly, so it has to be set to something like <kbd>https://en.wikipedia.org</kbd> or <kbd>https://meta.wikimedia.org</kbd>. If this parameter does not match the <code>Origin</code> header, a 403 response will be returned. If this parameter matches the <code>Origin</code> header and the origin is whitelisted, an <code>Access-Control-Allow-Origin</code> header will be set.\";'),('en','messages:apihelp-main-param-uselang','s:325:\"Language to use for message translations. A list of codes may be fetched from <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> with <kbd>siprop=languages</kbd>, or specify <kbd>user</kbd> to use the current user\'s language preference, or specify <kbd>content</kbd> to use this wiki\'s content language.\";'),('en','messages:apihelp-block-description','s:13:\"Block a user.\";'),('en','messages:apihelp-block-param-user','s:43:\"Username, IP address, or IP range to block.\";'),('en','messages:apihelp-block-param-expiry','s:233:\"Expiry time. May be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). If set to <kbd>infinite</kbd>, <kbd>indefinite</kbd>, or <kbd>never</kbd>, the block will never expire.\";'),('en','messages:apihelp-block-param-reason','s:17:\"Reason for block.\";'),('en','messages:apihelp-block-param-anononly','s:78:\"Block anonymous users only (i.e. disable anonymous edits for this IP address).\";'),('en','messages:apihelp-block-param-nocreate','s:25:\"Prevent account creation.\";'),('en','messages:apihelp-block-param-autoblock','s:101:\"Automatically block the last used IP address, and any subsequent IP addresses they try to login from.\";'),('en','messages:apihelp-block-param-noemail','s:95:\"Prevent user from sending email through the wiki. (Requires the <code>blockemail</code> right).\";'),('en','messages:apihelp-block-param-hidename','s:81:\"Hide the username from the block log. (Requires the <code>hideuser</code> right).\";'),('en','messages:apihelp-block-param-allowusertalk','s:123:\"Allow the user to edit their own talk page (depends on <var>[[mw:Manual:$wgBlockAllowsUTEdit|$wgBlockAllowsUTEdit]]</var>).\";'),('en','messages:apihelp-block-param-reblock','s:61:\"If the user is already blocked, overwrite the existing block.\";'),('en','messages:apihelp-block-param-watchuser','s:53:\"Watch the user\'s or IP address\'s user and talk pages.\";'),('en','messages:apihelp-block-example-ip-simple','s:89:\"Block IP address <kbd>192.0.2.5</kbd> for three days with reason <kbd>First strike</kbd>.\";'),('en','messages:apihelp-block-example-user-complex','s:127:\"Block user <kbd>Vandal</kbd> indefinitely with reason <kbd>Vandalism</kbd>, and prevent new account creation and email sending.\";'),('en','messages:apihelp-checktoken-description','s:104:\"Check the validity of a token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\";'),('en','messages:apihelp-checktoken-param-type','s:27:\"Type of token being tested.\";'),('en','messages:apihelp-checktoken-param-token','s:14:\"Token to test.\";'),('en','messages:apihelp-checktoken-param-maxtokenage','s:45:\"Maximum allowed age of the token, in seconds.\";'),('en','messages:apihelp-checktoken-example-simple','s:45:\"Test the validity of a <kbd>csrf</kbd> token.\";'),('en','messages:apihelp-clearhasmsg-description','s:57:\"Clears the <code>hasmsg</code> flag for the current user.\";'),('en','messages:apihelp-clearhasmsg-example-1','s:56:\"Clear the <code>hasmsg</code> flag for the current user.\";'),('en','messages:apihelp-compare-description','s:123:\"Get the difference between 2 pages.\n\nA revision number, a page title, or a page ID for both \"from\" and \"to\" must be passed.\";'),('en','messages:apihelp-compare-param-fromtitle','s:23:\"First title to compare.\";'),('en','messages:apihelp-compare-param-fromid','s:25:\"First page ID to compare.\";'),('en','messages:apihelp-compare-param-fromrev','s:26:\"First revision to compare.\";'),('en','messages:apihelp-compare-param-totitle','s:24:\"Second title to compare.\";'),('en','messages:apihelp-compare-param-toid','s:26:\"Second page ID to compare.\";'),('en','messages:apihelp-compare-param-torev','s:27:\"Second revision to compare.\";'),('en','messages:apihelp-compare-example-1','s:39:\"Create a diff between revision 1 and 2.\";'),('en','messages:apihelp-createaccount-description','s:26:\"Create a new user account.\";'),('en','messages:apihelp-createaccount-param-name','s:9:\"Username.\";'),('en','messages:apihelp-createaccount-param-password','s:55:\"Password (ignored if <var>$1mailpassword</var> is set).\";'),('en','messages:apihelp-createaccount-param-domain','s:46:\"Domain for external authentication (optional).\";'),('en','messages:apihelp-createaccount-param-token','s:49:\"Account creation token obtained in first request.\";'),('en','messages:apihelp-createaccount-param-email','s:33:\"Email address of user (optional).\";'),('en','messages:apihelp-createaccount-param-realname','s:29:\"Real name of user (optional).\";'),('en','messages:apihelp-createaccount-param-mailpassword','s:67:\"If set to any value, a random password will be emailed to the user.\";'),('en','messages:apihelp-createaccount-param-reason','s:63:\"Optional reason for creating the account to be put in the logs.\";'),('en','messages:apihelp-createaccount-param-language','s:86:\"Language code to set as default for the user (optional, defaults to content language).\";'),('en','messages:apihelp-createaccount-example-pass','s:65:\"Create user <kbd>testuser</kbd> with password <kbd>test123</kbd>.\";'),('en','messages:apihelp-createaccount-example-mail','s:76:\"Create user <kbd>testmailuser</kbd> and email a randomly-generated password.\";'),('en','messages:apihelp-delete-description','s:14:\"Delete a page.\";'),('en','messages:apihelp-delete-param-title','s:78:\"Title of the page to delete. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-delete-param-pageid','s:79:\"Page ID of the page to delete. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-delete-param-reason','s:84:\"Reason for the deletion. If not set, an automatically generated reason will be used.\";'),('en','messages:apihelp-delete-param-watch','s:45:\"Add the page to the current user\'s watchlist.\";'),('en','messages:apihelp-delete-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-delete-param-unwatch','s:50:\"Remove the page from the current user\'s watchlist.\";'),('en','messages:apihelp-delete-param-oldimage','s:134:\"The name of the old image to delete as provided by [[Special:ApiHelp/query+imageinfo|action=query&prop=imageinfo&iiprop=archivename]].\";'),('en','messages:apihelp-delete-example-simple','s:28:\"Delete <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-delete-example-reason','s:74:\"Delete <kbd>Main Page</kbd> with the reason <kbd>Preparing for move</kbd>.\";'),('en','messages:apihelp-disabled-description','s:30:\"This module has been disabled.\";'),('en','messages:apihelp-edit-description','s:22:\"Create and edit pages.\";'),('en','messages:apihelp-edit-param-title','s:76:\"Title of the page to edit. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-edit-param-pageid','s:77:\"Page ID of the page to edit. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-edit-param-section','s:83:\"Section number. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section.\";'),('en','messages:apihelp-edit-param-sectiontitle','s:28:\"The title for a new section.\";'),('en','messages:apihelp-edit-param-text','s:13:\"Page content.\";'),('en','messages:apihelp-edit-param-summary','s:82:\"Edit summary. Also section title when $1section=new and $1sectiontitle is not set.\";'),('en','messages:apihelp-edit-param-tags','s:37:\"Change tags to apply to the revision.\";'),('en','messages:apihelp-edit-param-minor','s:11:\"Minor edit.\";'),('en','messages:apihelp-edit-param-notminor','s:15:\"Non-minor edit.\";'),('en','messages:apihelp-edit-param-bot','s:22:\"Mark this edit as bot.\";'),('en','messages:apihelp-edit-param-basetimestamp','s:168:\"Timestamp of the base revision, used to detect edit conflicts. May be obtained through [[Special:ApiHelp/query+revisions|action=query&prop=revisions&rvprop=timestamp]].\";'),('en','messages:apihelp-edit-param-starttimestamp','s:242:\"Timestamp when the editing process began, used to detect edit conflicts. An appropriate value may be obtained using <var>[[Special:ApiHelp/main|curtimestamp]]</var> when beginning the edit process (e.g. when loading the page content to edit).\";'),('en','messages:apihelp-edit-param-recreate','s:71:\"Override any errors about the page having been deleted in the meantime.\";'),('en','messages:apihelp-edit-param-createonly','s:41:\"Don\'t edit the page if it exists already.\";'),('en','messages:apihelp-edit-param-nocreate','s:41:\"Throw an error if the page doesn\'t exist.\";'),('en','messages:apihelp-edit-param-watch','s:45:\"Add the page to the current user\'s watchlist.\";'),('en','messages:apihelp-edit-param-unwatch','s:50:\"Remove the page from the current user\'s watchlist.\";'),('en','messages:apihelp-edit-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-edit-param-md5','s:159:\"The MD5 hash of the $1text parameter, or the $1prependtext and $1appendtext parameters concatenated. If set, the edit won\'t be done unless the hash is correct.\";'),('en','messages:apihelp-edit-param-prependtext','s:61:\"Add this text to the beginning of the page. Overrides $1text.\";'),('en','messages:apihelp-edit-param-appendtext','s:127:\"Add this text to the end of the page. Overrides $1text.\n\nUse $1section=new to append a new section, rather than this parameter.\";'),('en','messages:apihelp-edit-param-undo','s:69:\"Undo this revision. Overrides $1text, $1prependtext and $1appendtext.\";'),('en','messages:apihelp-edit-param-undoafter','s:79:\"Undo all revisions from $1undo to this one. If not set, just undo one revision.\";'),('en','messages:apihelp-edit-param-redirect','s:32:\"Automatically resolve redirects.\";'),('en','messages:apihelp-edit-param-contentformat','s:53:\"Content serialization format used for the input text.\";'),('en','messages:apihelp-edit-param-contentmodel','s:33:\"Content model of the new content.\";'),('en','messages:apihelp-edit-param-token','s:94:\"The token should always be sent as the last parameter, or at least after the $1text parameter.\";'),('en','messages:apihelp-edit-example-edit','s:12:\"Edit a page.\";'),('en','messages:apihelp-edit-example-prepend','s:47:\"Prepend <kbd>_&#95;NOTOC_&#95;</kbd> to a page.\";'),('en','messages:apihelp-edit-example-undo','s:52:\"Undo revisions 13579 through 13585 with autosummary.\";'),('en','messages:apihelp-emailuser-description','s:13:\"Email a user.\";'),('en','messages:apihelp-emailuser-param-target','s:22:\"User to send email to.\";'),('en','messages:apihelp-emailuser-param-subject','s:15:\"Subject header.\";'),('en','messages:apihelp-emailuser-param-text','s:10:\"Mail body.\";'),('en','messages:apihelp-emailuser-param-ccme','s:31:\"Send a copy of this mail to me.\";'),('en','messages:apihelp-emailuser-example-email','s:80:\"Send an email to the User <kbd>WikiSysop</kbd> with the text <kbd>Content</kbd>.\";'),('en','messages:apihelp-expandtemplates-description','s:34:\"Expands all templates in wikitext.\";'),('en','messages:apihelp-expandtemplates-param-title','s:14:\"Title of page.\";'),('en','messages:apihelp-expandtemplates-param-text','s:20:\"Wikitext to convert.\";'),('en','messages:apihelp-expandtemplates-param-revid','s:71:\"Revision ID, for <nowiki>{{REVISIONID}}</nowiki> and similar variables.\";'),('en','messages:apihelp-expandtemplates-param-prop','s:579:\"Which pieces of information to get:\n;wikitext:The expanded wikitext.\n;categories:Any categories present in the input that are not represented in the wikitext output.\n;properties:Page properties defined by expanded magic words in the wikitext.\n;volatile:Whether the output is volatile and should not be reused elsewhere within the page.\n;ttl:The maximum time after which caches of the result should be invalidated.\n;parsetree:The XML parse tree of the input.\nNote that if no values are selected, the result will contain the wikitext, but the output will be in a deprecated format.\";'),('en','messages:apihelp-expandtemplates-param-includecomments','s:47:\"Whether to include HTML comments in the output.\";'),('en','messages:apihelp-expandtemplates-param-generatexml','s:55:\"Generate XML parse tree (replaced by $1prop=parsetree).\";'),('en','messages:apihelp-expandtemplates-example-simple','s:68:\"Expand the wikitext <kbd><nowiki>{{Project:Sandbox}}</nowiki></kbd>.\";'),('en','messages:apihelp-feedcontributions-description','s:34:\"Returns a user contributions feed.\";'),('en','messages:apihelp-feedcontributions-param-feedformat','s:23:\"The format of the feed.\";'),('en','messages:apihelp-feedcontributions-param-user','s:40:\"What users to get the contributions for.\";'),('en','messages:apihelp-feedcontributions-param-namespace','s:47:\"Which namespace to filter the contributions by.\";'),('en','messages:apihelp-feedcontributions-param-year','s:24:\"From year (and earlier).\";'),('en','messages:apihelp-feedcontributions-param-month','s:25:\"From month (and earlier).\";'),('en','messages:apihelp-feedcontributions-param-tagfilter','s:42:\"Filter contributions that have these tags.\";'),('en','messages:apihelp-feedcontributions-param-deletedonly','s:32:\"Show only deleted contributions.\";'),('en','messages:apihelp-feedcontributions-param-toponly','s:42:\"Only show edits that are latest revisions.\";'),('en','messages:apihelp-feedcontributions-param-newonly','s:40:\"Only show edits that are page creations.\";'),('en','messages:apihelp-feedcontributions-param-showsizediff','s:43:\"Show the size difference between revisions.\";'),('en','messages:apihelp-feedcontributions-example-simple','s:49:\"Return contributions for user <kbd>Example</kbd>.\";'),('en','messages:apihelp-feedrecentchanges-description','s:30:\"Returns a recent changes feed.\";'),('en','messages:apihelp-feedrecentchanges-param-feedformat','s:23:\"The format of the feed.\";'),('en','messages:apihelp-feedrecentchanges-param-namespace','s:34:\"Namespace to limit the results to.\";'),('en','messages:apihelp-feedrecentchanges-param-invert','s:36:\"All namespaces but the selected one.\";'),('en','messages:apihelp-feedrecentchanges-param-associated','s:44:\"Include associated (talk or main) namespace.\";'),('en','messages:apihelp-feedrecentchanges-param-days','s:29:\"Days to limit the results to.\";'),('en','messages:apihelp-feedrecentchanges-param-limit','s:36:\"Maximum number of results to return.\";'),('en','messages:apihelp-feedrecentchanges-param-from','s:24:\"Show changes since then.\";'),('en','messages:apihelp-feedrecentchanges-param-hideminor','s:19:\"Hide minor changes.\";'),('en','messages:apihelp-feedrecentchanges-param-hidebots','s:26:\"Hide changes made by bots.\";'),('en','messages:apihelp-feedrecentchanges-param-hideanons','s:37:\"Hide changes made by anonymous users.\";'),('en','messages:apihelp-feedrecentchanges-param-hideliu','s:38:\"Hide changes made by registered users.\";'),('en','messages:apihelp-feedrecentchanges-param-hidepatrolled','s:23:\"Hide patrolled changes.\";'),('en','messages:apihelp-feedrecentchanges-param-hidemyself','s:38:\"Hide changes made by the current user.\";'),('en','messages:apihelp-feedrecentchanges-param-tagfilter','s:14:\"Filter by tag.\";'),('en','messages:apihelp-feedrecentchanges-param-target','s:49:\"Show only changes on pages linked from this page.\";'),('en','messages:apihelp-feedrecentchanges-param-showlinkedto','s:58:\"Show changes on pages linked to the selected page instead.\";'),('en','messages:apihelp-feedrecentchanges-example-simple','s:20:\"Show recent changes.\";'),('en','messages:apihelp-feedrecentchanges-example-30days','s:32:\"Show recent changes for 30 days.\";'),('en','messages:apihelp-feedwatchlist-description','s:25:\"Returns a watchlist feed.\";'),('en','messages:apihelp-feedwatchlist-param-feedformat','s:23:\"The format of the feed.\";'),('en','messages:apihelp-feedwatchlist-param-hours','s:52:\"List pages modified within this many hours from now.\";'),('en','messages:apihelp-feedwatchlist-param-linktosections','s:46:\"Link directly to changed sections if possible.\";'),('en','messages:apihelp-feedwatchlist-example-default','s:24:\"Show the watchlist feed.\";'),('en','messages:apihelp-feedwatchlist-example-all6hrs','s:54:\"Show all changes to watched pages in the past 6 hours.\";'),('en','messages:apihelp-filerevert-description','s:32:\"Revert a file to an old version.\";'),('en','messages:apihelp-filerevert-param-filename','s:42:\"Target filename, without the File: prefix.\";'),('en','messages:apihelp-filerevert-param-comment','s:15:\"Upload comment.\";'),('en','messages:apihelp-filerevert-param-archivename','s:42:\"Archive name of the revision to revert to.\";'),('en','messages:apihelp-filerevert-example-revert','s:77:\"Revert <kbd>Wiki.png</kbd> to the version of <kbd>2011-03-05T15:27:40Z</kbd>.\";'),('en','messages:apihelp-help-description','s:39:\"Display help for the specified modules.\";'),('en','messages:apihelp-help-param-modules','s:159:\"Modules to display help for (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>.\";'),('en','messages:apihelp-help-param-submodules','s:48:\"Include help for submodules of the named module.\";'),('en','messages:apihelp-help-param-recursivesubmodules','s:40:\"Include help for submodules recursively.\";'),('en','messages:apihelp-help-param-helpformat','s:26:\"Format of the help output.\";'),('en','messages:apihelp-help-param-wrap','s:53:\"Wrap the output in a standard API response structure.\";'),('en','messages:apihelp-help-param-toc','s:47:\"Include a table of contents in the HTML output.\";'),('en','messages:apihelp-help-example-main','s:25:\"Help for the main module.\";'),('en','messages:apihelp-help-example-recursive','s:21:\"All help in one page.\";'),('en','messages:apihelp-help-example-help','s:32:\"Help for the help module itself.\";'),('en','messages:apihelp-help-example-query','s:30:\"Help for two query submodules.\";'),('en','messages:apihelp-imagerotate-description','s:26:\"Rotate one or more images.\";'),('en','messages:apihelp-imagerotate-param-rotation','s:34:\"Degrees to rotate image clockwise.\";'),('en','messages:apihelp-imagerotate-example-simple','s:60:\"Rotate <kbd>File:Example.png</kbd> by <kbd>90</kbd> degrees.\";'),('en','messages:apihelp-imagerotate-example-generator','s:72:\"Rotate all images in <kbd>Category:Flip</kbd> by <kbd>180</kbd> degrees.\";'),('en','messages:apihelp-import-description','s:190:\"Import a page from another wiki, or an XML file.\n\nNote that the HTTP POST must be done as a file upload (i.e. using multipart/form-data) when sending a file for the <var>xml</var> parameter.\";'),('en','messages:apihelp-import-param-summary','s:15:\"Import summary.\";'),('en','messages:apihelp-import-param-xml','s:18:\"Uploaded XML file.\";'),('en','messages:apihelp-import-param-interwikisource','s:43:\"For interwiki imports: wiki to import from.\";'),('en','messages:apihelp-import-param-interwikipage','s:38:\"For interwiki imports: page to import.\";'),('en','messages:apihelp-import-param-fullhistory','s:77:\"For interwiki imports: import the full history, not just the current version.\";'),('en','messages:apihelp-import-param-templates','s:61:\"For interwiki imports: import all included templates as well.\";'),('en','messages:apihelp-import-param-namespace','s:48:\"For interwiki imports: import to this namespace.\";'),('en','messages:apihelp-import-param-rootpage','s:31:\"Import as subpage of this page.\";'),('en','messages:apihelp-import-example-import','s:72:\"Import [[meta:Help:Parserfunctions]] to namespace 100 with full history.\";'),('en','messages:apihelp-login-description','s:255:\"Log in and get authentication cookies.\n\nIn the event of a successful log-in, the needed cookies will be included in the HTTP response headers. In the event of a failed log-in, further attempts may be throttled to limit automated password guessing attacks.\";'),('en','messages:apihelp-login-param-name','s:10:\"User name.\";'),('en','messages:apihelp-login-param-password','s:9:\"Password.\";'),('en','messages:apihelp-login-param-domain','s:18:\"Domain (optional).\";'),('en','messages:apihelp-login-param-token','s:38:\"Login token obtained in first request.\";'),('en','messages:apihelp-login-example-gettoken','s:23:\"Retrieve a login token.\";'),('en','messages:apihelp-login-example-login','s:7:\"Log in.\";'),('en','messages:apihelp-logout-description','s:31:\"Log out and clear session data.\";'),('en','messages:apihelp-logout-example-logout','s:25:\"Log the current user out.\";'),('en','messages:apihelp-managetags-description','s:49:\"Perform management tasks relating to change tags.\";'),('en','messages:apihelp-managetags-param-operation','s:379:\"Which operation to perform:\n;create:Create a new change tag for manual use.\n;delete:Remove a change tag from the database, including removing the tag from all revisions, recent change entries and log entries on which it is used.\n;activate:Activate a change tag, allowing users to apply it manually.\n;deactivate:Deactivate a change tag, preventing users from applying it manually.\";'),('en','messages:apihelp-managetags-param-tag','s:277:\"Tag to create, delete, activate or deactivate. For tag creation, the tag must not exist. For tag deletion, the tag must exist. For tag activation, the tag must exist and not be in use by an extension. For tag deactivation, the tag must be currently active and manually defined.\";'),('en','messages:apihelp-managetags-param-reason','s:78:\"An optional reason for creating, deleting, activating or deactivating the tag.\";'),('en','messages:apihelp-managetags-param-ignorewarnings','s:68:\"Whether to ignore any warnings that are issued during the operation.\";'),('en','messages:apihelp-managetags-example-create','s:88:\"Create a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),('en','messages:apihelp-managetags-example-delete','s:71:\"Delete the <kbd>vandlaism</kbd> tag with the reason <kbd>Misspelt</kbd>\";'),('en','messages:apihelp-managetags-example-activate','s:90:\"Activate a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),('en','messages:apihelp-managetags-example-deactivate','s:84:\"Deactivate a tag named <kbd>spam</kbd> with the reason <kbd>No longer required</kbd>\";'),('en','messages:apihelp-move-description','s:12:\"Move a page.\";'),('en','messages:apihelp-move-param-from','s:78:\"Title of the page to rename. Cannot be used together with <var>$1fromid</var>.\";'),('en','messages:apihelp-move-param-fromid','s:78:\"Page ID of the page to rename. Cannot be used together with <var>$1from</var>.\";'),('en','messages:apihelp-move-param-to','s:28:\"Title to rename the page to.\";'),('en','messages:apihelp-move-param-reason','s:22:\"Reason for the rename.\";'),('en','messages:apihelp-move-param-movetalk','s:35:\"Rename the talk page, if it exists.\";'),('en','messages:apihelp-move-param-movesubpages','s:31:\"Rename subpages, if applicable.\";'),('en','messages:apihelp-move-param-noredirect','s:24:\"Don\'t create a redirect.\";'),('en','messages:apihelp-move-param-watch','s:62:\"Add the page and the redirect to the current user\'s watchlist.\";'),('en','messages:apihelp-move-param-unwatch','s:67:\"Remove the page and the redirect from the current user\'s watchlist.\";'),('en','messages:apihelp-move-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-move-param-ignorewarnings','s:20:\"Ignore any warnings.\";'),('en','messages:apihelp-move-example-move','s:76:\"Move <kbd>Badtitle</kbd> to <kbd>Goodtitle</kbd> without leaving a redirect.\";'),('en','messages:apihelp-opensearch-description','s:46:\"Search the wiki using the OpenSearch protocol.\";'),('en','messages:apihelp-opensearch-param-search','s:14:\"Search string.\";'),('en','messages:apihelp-opensearch-param-limit','s:36:\"Maximum number of results to return.\";'),('en','messages:apihelp-opensearch-param-namespace','s:21:\"Namespaces to search.\";'),('en','messages:apihelp-opensearch-param-suggest','s:102:\"Do nothing if <var>[[mw:Manual:$wgEnableOpenSearchSuggest|$wgEnableOpenSearchSuggest]]</var> is false.\";'),('en','messages:apihelp-opensearch-param-redirects','s:231:\"How to handle redirects:\n;return:Return the redirect itself.\n;resolve:Return the target page. May return fewer than $1limit results.\nFor historical reasons, the default is \"return\" for $1format=json and \"resolve\" for other formats.\";'),('en','messages:apihelp-opensearch-param-format','s:25:\"The format of the output.\";'),('en','messages:apihelp-opensearch-param-warningsaserror','s:97:\"If warnings are raised with <kbd>format=json</kbd>, return an API error instead of ignoring them.\";'),('en','messages:apihelp-opensearch-example-te','s:40:\"Find pages beginning with <kbd>Te</kbd>.\";'),('en','messages:apihelp-options-description','s:213:\"Change preferences of the current user.\n\nOnly options which are registered in core or in one of installed extensions, or options with keys prefixed with \"userjs-\" (intended to be used by user scripts), can be set.\";'),('en','messages:apihelp-options-param-reset','s:40:\"Resets preferences to the site defaults.\";'),('en','messages:apihelp-options-param-resetkinds','s:76:\"List of types of options to reset when the <var>$1reset</var> option is set.\";'),('en','messages:apihelp-options-param-change','s:224:\"List of changes, formatted name=value (e.g. skin=vector). Value cannot contain pipe characters. If no value is given (not even an equals sign), e.g., optionname|otheroption|..., the option will be reset to its default value.\";'),('en','messages:apihelp-options-param-optionname','s:86:\"A name of a option which should be set to the value given by <var>$1optionvalue</var>.\";'),('en','messages:apihelp-options-param-optionvalue','s:88:\"A value of the option specified by <var>$1optionname</var>, can contain pipe characters.\";'),('en','messages:apihelp-options-example-reset','s:22:\"Reset all preferences.\";'),('en','messages:apihelp-options-example-change','s:60:\"Change <kbd>skin</kbd> and <kbd>hideminor</kbd> preferences.\";'),('en','messages:apihelp-options-example-complex','s:72:\"Reset all preferences, then set <kbd>skin</kbd> and <kbd>nickname</kbd>.\";'),('en','messages:apihelp-paraminfo-description','s:37:\"Obtain information about API modules.\";'),('en','messages:apihelp-paraminfo-param-modules','s:152:\"List of module names (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>.\";'),('en','messages:apihelp-paraminfo-param-helpformat','s:23:\"Format of help strings.\";'),('en','messages:apihelp-paraminfo-param-querymodules','s:177:\"List of query module names (value of <var>prop</var>, <var>meta</var> or <var>list</var> parameter). Use <kbd>$1modules=query+foo</kbd> instead of <kbd>$1querymodules=foo</kbd>.\";'),('en','messages:apihelp-paraminfo-param-mainmodule','s:97:\"Get information about the main (top-level) module as well. Use <kbd>$1modules=main</kbd> instead.\";'),('en','messages:apihelp-paraminfo-param-pagesetmodule','s:81:\"Get information about the pageset module (providing titles= and friends) as well.\";'),('en','messages:apihelp-paraminfo-param-formatmodules','s:101:\"List of format module names (value of <var>format</var> parameter). Use <var>$1modules</var> instead.\";'),('en','messages:apihelp-paraminfo-example-1','s:269:\"Show info for <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, and <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('en','messages:apihelp-parse-description','s:523:\"Parses content and returns parser output.\n\nSee the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.\n\nThere are several ways to specify the text to parse:\n# Specify a page or revision, using <var>$1page</var>, <var>$1pageid</var>, or <var>$1oldid</var>.\n# Specify content explicitly, using <var>$1text</var>, <var>$1title</var>, and <var>$1contentmodel</var>.\n# Specify only a summary to parse. <var>$1prop</var> should be given an empty value.\";'),('en','messages:apihelp-parse-param-title','s:130:\"Title of page the text belongs to. If omitted, <var>$1contentmodel</var> must be specified, and [[API]] will be used as the title.\";'),('en','messages:apihelp-parse-param-text','s:96:\"Text to parse. Use <var>$1title</var> or <var>$1contentmodel</var> to control the content model.\";'),('en','messages:apihelp-parse-param-summary','s:17:\"Summary to parse.\";'),('en','messages:apihelp-parse-param-page','s:102:\"Parse the content of this page. Cannot be used together with <var>$1text</var> and <var>$1title</var>.\";'),('en','messages:apihelp-parse-param-pageid','s:60:\"Parse the content of this page. Overrides <var>$1page</var>.\";'),('en','messages:apihelp-parse-param-redirects','s:77:\"If <var>$1page</var> or <var>$1pageid</var> is set to a redirect, resolve it.\";'),('en','messages:apihelp-parse-param-oldid','s:88:\"Parse the content of this revision. Overrides <var>$1page</var> and <var>$1pageid</var>.\";'),('en','messages:apihelp-parse-param-prop','s:1257:\"Which pieces of information to get:\n;text:Gives the parsed text of the wikitext.\n;langlinks:Gives the language links in the parsed wikitext.\n;categories:Gives the categories in the parsed wikitext.\n;categorieshtml:Gives the HTML version of the categories.\n;links:Gives the internal links in the parsed wikitext.\n;templates:Gives the templates in the parsed wikitext.\n;images:Gives the images in the parsed wikitext.\n;externallinks:Gives the external links in the parsed wikitext.\n;sections:Gives the sections in the parsed wikitext.\n;revid:Adds the revision ID of the parsed page.\n;displaytitle:Adds the title of the parsed wikitext.\n;headitems:Gives items to put in the &lt;head&gt; of the page.\n;headhtml:Gives parsed &lt;head&gt; of the page.\n;modules:Gives the ResourceLoader modules used on the page.\n;indicators:Gives the HTML of page status indicators used on the page.\n;iwlinks:Gives interwiki links in the parsed wikitext.\n;wikitext:Gives the original wikitext that was parsed.\n;properties:Gives various properties defined in the parsed wikitext.\n;limitreportdata:Gives the limit report in a structured way. Gives no data, when $1disablepp is set.\n;limitreporthtml:Gives the HTML version of the limit report. Gives no data, when $1disablepp is set.\";'),('en','messages:apihelp-parse-param-pst','s:87:\"Do a pre-save transform on the input before parsing it. Only valid when used with text.\";'),('en','messages:apihelp-parse-param-onlypst','s:165:\"Do a pre-save transform (PST) on the input, but don\'t parse it. Returns the same wikitext, after a PST has been applied. Only valid when used with <var>$1text</var>.\";'),('en','messages:apihelp-parse-param-effectivelanglinks','s:90:\"Includes language links supplied by extensions (for use with <kbd>$1prop=langlinks</kbd>).\";'),('en','messages:apihelp-parse-param-section','s:168:\"Only retrieve the content of this section number or when <kbd>new</kbd> generate a new section.\n\n<kbd>new</kbd> section is only honored when specifying <var>text</var>.\";'),('en','messages:apihelp-parse-param-sectiontitle','s:151:\"New section title when <var>section</var> is <kbd>new</kbd>.\n\nUnlike page editing, this does not fall back to <var>summary</var> when omitted or empty.\";'),('en','messages:apihelp-parse-param-disablepp','s:45:\"Disable the PP Report from the parser output.\";'),('en','messages:apihelp-parse-param-disableeditsection','s:50:\"Disable edit section links from the parser output.\";'),('en','messages:apihelp-parse-param-generatexml','s:65:\"Generate XML parse tree (requires content model <code>$1</code>).\";'),('en','messages:apihelp-parse-param-preview','s:22:\"Parse in preview mode.\";'),('en','messages:apihelp-parse-param-sectionpreview','s:57:\"Parse in section preview mode (enables preview mode too).\";'),('en','messages:apihelp-parse-param-disabletoc','s:36:\"Disable table of contents in output.\";'),('en','messages:apihelp-parse-param-contentformat','s:87:\"Content serialization format used for the input text. Only valid when used with $1text.\";'),('en','messages:apihelp-parse-param-contentmodel','s:159:\"Content model of the input text. If omitted, $1title must be specified, and default will be the model of the specified title. Only valid when used with $1text.\";'),('en','messages:apihelp-parse-example-page','s:13:\"Parse a page.\";'),('en','messages:apihelp-parse-example-text','s:15:\"Parse wikitext.\";'),('en','messages:apihelp-parse-example-texttitle','s:42:\"Parse wikitext, specifying the page title.\";'),('en','messages:apihelp-parse-example-summary','s:16:\"Parse a summary.\";'),('en','messages:apihelp-patrol-description','s:26:\"Patrol a page or revision.\";'),('en','messages:apihelp-patrol-param-rcid','s:27:\"Recentchanges ID to patrol.\";'),('en','messages:apihelp-patrol-param-revid','s:22:\"Revision ID to patrol.\";'),('en','messages:apihelp-patrol-example-rcid','s:23:\"Patrol a recent change.\";'),('en','messages:apihelp-patrol-example-revid','s:18:\"Patrol a revision.\";'),('en','messages:apihelp-protect-description','s:38:\"Change the protection level of a page.\";'),('en','messages:apihelp-protect-param-title','s:72:\"Title of the page to (un)protect. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-protect-param-pageid','s:68:\"ID of the page to (un)protect. Cannot be used together with $1title.\";'),('en','messages:apihelp-protect-param-protections','s:169:\"List of protection levels, formatted <kbd>action=level</kbd> (e.g. <kbd>edit=sysop</kbd>).\n\n<strong>Note:</strong> Any actions not listed will have restrictions removed.\";'),('en','messages:apihelp-protect-param-expiry','s:206:\"Expiry timestamps. If only one timestamp is set, it\'ll be used for all protections. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd>, for a never-expiring protection.\";'),('en','messages:apihelp-protect-param-reason','s:26:\"Reason for (un)protecting.\";'),('en','messages:apihelp-protect-param-cascade','s:136:\"Enable cascading protection (i.e. protect pages included in this page). Ignored if all protection levels given do not support cascading.\";'),('en','messages:apihelp-protect-param-watch','s:73:\"If set, add the page being (un)protected to the current user\'s watchlist.\";'),('en','messages:apihelp-protect-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-protect-example-protect','s:15:\"Protect a page.\";'),('en','messages:apihelp-protect-example-unprotect','s:59:\"Unprotect a page by setting restrictions to <kbd>all</kbd>.\";'),('en','messages:apihelp-protect-example-unprotect2','s:44:\"Unprotect a page by setting no restrictions.\";'),('en','messages:apihelp-purge-description','s:92:\"Purge the cache for the given titles.\n\nRequires a POST request if the user is not logged in.\";'),('en','messages:apihelp-purge-param-forcelinkupdate','s:24:\"Update the links tables.\";'),('en','messages:apihelp-purge-param-forcerecursivelinkupdate','s:99:\"Update the links table, and update the links tables for any page that uses this page as a template.\";'),('en','messages:apihelp-purge-example-simple','s:59:\"Purge the <kbd>Main Page</kbd> and the <kbd>API</kbd> page.\";'),('en','messages:apihelp-purge-example-generator','s:47:\"Purge the first 10 pages in the main namespace.\";'),('en','messages:apihelp-query-description','s:147:\"Fetch data from and about MediaWiki.\n\nAll data modifications will first have to use query to acquire a token to prevent abuse from malicious sites.\";'),('en','messages:apihelp-query-param-prop','s:46:\"Which properties to get for the queried pages.\";'),('en','messages:apihelp-query-param-list','s:19:\"Which lists to get.\";'),('en','messages:apihelp-query-param-meta','s:22:\"Which metadata to get.\";'),('en','messages:apihelp-query-param-indexpageids','s:68:\"Include an additional pageids section listing all returned page IDs.\";'),('en','messages:apihelp-query-param-export','s:61:\"Export the current revisions of all given or generated pages.\";'),('en','messages:apihelp-query-param-exportnowrap','s:127:\"Return the export XML without wrapping it in an XML result (same format as [[Special:Export]]). Can only be used with $1export.\";'),('en','messages:apihelp-query-param-iwurl','s:62:\"Whether to get the full URL if the title is an interwiki link.\";'),('en','messages:apihelp-query-param-continue','s:285:\"When present, formats query-continue as key-value pairs that should simply be merged into the original request. This parameter must be set to an empty string in the initial query.\n\nThis parameter is recommended for all new development, and will be made default in the next API version.\";'),('en','messages:apihelp-query-param-rawcontinue','s:156:\"Currently ignored. In the future, <var>$1continue</var> will become the default and this will be needed to receive the raw <samp>query-continue</samp> data.\";'),('en','messages:apihelp-query-example-revisions','s:125:\"Fetch [[Special:ApiHelp/query+siteinfo|site info]] and [[Special:ApiHelp/query+revisions|revisions]] of <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query-example-allpages','s:56:\"Fetch revisions of pages beginning with <kbd>API/</kbd>.\";'),('en','messages:apihelp-query+allcategories-description','s:25:\"Enumerate all categories.\";'),('en','messages:apihelp-query+allcategories-param-from','s:39:\"The category to start enumerating from.\";'),('en','messages:apihelp-query+allcategories-param-to','s:36:\"The category to stop enumerating at.\";'),('en','messages:apihelp-query+allcategories-param-prefix','s:58:\"Search for all category titles that begin with this value.\";'),('en','messages:apihelp-query+allcategories-param-dir','s:21:\"Direction to sort in.\";'),('en','messages:apihelp-query+allcategories-param-min','s:55:\"Only return categories with at least this many members.\";'),('en','messages:apihelp-query+allcategories-param-max','s:54:\"Only return categories with at most this many members.\";'),('en','messages:apihelp-query+allcategories-param-limit','s:30:\"How many categories to return.\";'),('en','messages:apihelp-query+allcategories-param-prop','s:136:\"Which properties to get:\n;size:Adds number of pages in the category.\n;hidden:Tags categories that are hidden with _&#95;HIDDENCAT_&#95;.\";'),('en','messages:apihelp-query+allcategories-example-size','s:64:\"List categories with information on the number of pages in each.\";'),('en','messages:apihelp-query+allcategories-example-generator','s:86:\"Retrieve info about the category page itself for categories beginning <kbd>List</kbd>.\";'),('en','messages:apihelp-query+alldeletedrevisions-description','s:55:\"List all deleted revisions by a user or in a namespace.\";'),('en','messages:apihelp-query+alldeletedrevisions-paraminfo-useronly','s:40:\"May only be used with <var>$3user</var>.\";'),('en','messages:apihelp-query+alldeletedrevisions-paraminfo-nonuseronly','s:38:\"Cannot be used with <var>$3user</var>.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-from','s:28:\"Start listing at this title.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-to','s:27:\"Stop listing at this title.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-namespace','s:34:\"Only list pages in this namespace.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-miser-user-namespace','s:256:\"<strong>Note:</strong> Due to [[mw:Manual:$wgMiserMode|miser mode]], using <var>$1user</var> and <var>$1namespace</var> together may result in fewer than <var>$1limit</var> results returned before continuing; in extreme cases, zero results may be returned.\";'),('en','messages:apihelp-query+alldeletedrevisions-param-generatetitles','s:73:\"When being used as a generator, generate titles rather than revision IDs.\";'),('en','messages:apihelp-query+alldeletedrevisions-example-user','s:65:\"List the last 50 deleted contributions by user <kbd>Example<kbd>.\";'),('en','messages:apihelp-query+alldeletedrevisions-example-ns-main','s:58:\"List the first 50 deleted revisions in the main namespace.\";'),('en','messages:apihelp-query+allfileusages-description','s:45:\"List all file usages, including non-existing.\";'),('en','messages:apihelp-query+allfileusages-param-from','s:48:\"The title of the file to start enumerating from.\";'),('en','messages:apihelp-query+allfileusages-param-to','s:45:\"The title of the file to stop enumerating at.\";'),('en','messages:apihelp-query+allfileusages-param-prefix','s:54:\"Search for all file titles that begin with this value.\";'),('en','messages:apihelp-query+allfileusages-param-unique','s:134:\"Only show distinct file titles. Cannot be used with $1prop=ids.\nWhen used as a generator, yields target pages instead of source pages.\";'),('en','messages:apihelp-query+allfileusages-param-prop','s:146:\"Which pieces of information to include:\n;ids:Adds the page ID of the using page (cannot be used with $1unique).\n;title:Adds the title of the file.\";'),('en','messages:apihelp-query+allfileusages-param-limit','s:31:\"How many total items to return.\";'),('en','messages:apihelp-query+allfileusages-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+allfileusages-example-B','s:96:\"List file titles, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('en','messages:apihelp-query+allfileusages-example-unique','s:24:\"List unique file titles.\";'),('en','messages:apihelp-query+allfileusages-example-unique-generator','s:47:\"Gets all file titles, marking the missing ones.\";'),('en','messages:apihelp-query+allfileusages-example-generator','s:32:\"Gets pages containing the files.\";'),('en','messages:apihelp-query+allimages-description','s:34:\"Enumerate all images sequentially.\";'),('en','messages:apihelp-query+allimages-param-sort','s:20:\"Property to sort by.\";'),('en','messages:apihelp-query+allimages-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+allimages-param-from','s:77:\"The image title to start enumerating from. Can only be used with $1sort=name.\";'),('en','messages:apihelp-query+allimages-param-to','s:74:\"The image title to stop enumerating at. Can only be used with $1sort=name.\";'),('en','messages:apihelp-query+allimages-param-start','s:80:\"The timestamp to start enumerating from. Can only be used with $1sort=timestamp.\";'),('en','messages:apihelp-query+allimages-param-end','s:73:\"The timestamp to end enumerating. Can only be used with $1sort=timestamp.\";'),('en','messages:apihelp-query+allimages-param-prefix','s:90:\"Search for all image titles that begin with this value. Can only be used with $1sort=name.\";'),('en','messages:apihelp-query+allimages-param-minsize','s:46:\"Limit to images with at least this many bytes.\";'),('en','messages:apihelp-query+allimages-param-maxsize','s:45:\"Limit to images with at most this many bytes.\";'),('en','messages:apihelp-query+allimages-param-sha1','s:43:\"SHA1 hash of image. Overrides $1sha1base36.\";'),('en','messages:apihelp-query+allimages-param-sha1base36','s:50:\"SHA1 hash of image in base 36 (used in MediaWiki).\";'),('en','messages:apihelp-query+allimages-param-user','s:123:\"Only return files uploaded by this user. Can only be used with $1sort=timestamp. Cannot be used together with $1filterbots.\";'),('en','messages:apihelp-query+allimages-param-filterbots','s:114:\"How to filter files uploaded by bots. Can only be used with $1sort=timestamp. Cannot be used together with $1user.\";'),('en','messages:apihelp-query+allimages-param-mime','s:58:\"What MIME types to search for, e.g. <kbd>image/jpeg</kbd>.\";'),('en','messages:apihelp-query+allimages-param-limit','s:35:\"How many images in total to return.\";'),('en','messages:apihelp-query+allimages-example-B','s:57:\"Show a list of files starting at the letter <kbd>B</kbd>.\";'),('en','messages:apihelp-query+allimages-example-recent','s:72:\"Show a list of recently uploaded files, similar to [[Special:NewFiles]].\";'),('en','messages:apihelp-query+allimages-example-mimetypes','s:80:\"Show a list of files with MIME type <kbd>image/png</kbd> or <kbd>image/gif</kbd>\";'),('en','messages:apihelp-query+allimages-example-generator','s:60:\"Show info about 4 files starting at the letter <kbd>T</kbd>.\";'),('en','messages:apihelp-query+alllinks-description','s:52:\"Enumerate all links that point to a given namespace.\";'),('en','messages:apihelp-query+alllinks-param-from','s:48:\"The title of the link to start enumerating from.\";'),('en','messages:apihelp-query+alllinks-param-to','s:45:\"The title of the link to stop enumerating at.\";'),('en','messages:apihelp-query+alllinks-param-prefix','s:56:\"Search for all linked titles that begin with this value.\";'),('en','messages:apihelp-query+alllinks-param-unique','s:147:\"Only show distinct linked titles. Cannot be used with <kbd>$1prop=ids</kbd>.\nWhen used as a generator, yields target pages instead of source pages.\";'),('en','messages:apihelp-query+alllinks-param-prop','s:159:\"Which pieces of information to include:\n;ids:Adds the page ID of the linking page (cannot be used with <var>$1unique</var>).\n;title:Adds the title of the link.\";'),('en','messages:apihelp-query+alllinks-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+alllinks-param-limit','s:31:\"How many total items to return.\";'),('en','messages:apihelp-query+alllinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+alllinks-example-B','s:98:\"List linked titles, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('en','messages:apihelp-query+alllinks-example-unique','s:26:\"List unique linked titles.\";'),('en','messages:apihelp-query+alllinks-example-unique-generator','s:49:\"Gets all linked titles, marking the missing ones.\";'),('en','messages:apihelp-query+alllinks-example-generator','s:32:\"Gets pages containing the links.\";'),('en','messages:apihelp-query+allmessages-description','s:31:\"Return messages from this site.\";'),('en','messages:apihelp-query+allmessages-param-messages','s:68:\"Which messages to output. <kbd>*</kbd> (default) means all messages.\";'),('en','messages:apihelp-query+allmessages-param-prop','s:24:\"Which properties to get.\";'),('en','messages:apihelp-query+allmessages-param-enableparser','s:111:\"Set to enable parser, will preprocess the wikitext of message (substitute magic words, handle templates, etc.).\";'),('en','messages:apihelp-query+allmessages-param-nocontent','s:65:\"If set, do not include the content of the messages in the output.\";'),('en','messages:apihelp-query+allmessages-param-includelocal','s:241:\"Also include local messages, i.e. messages that don\'t exist in the software but do exist as a MediaWiki: page.\nThis lists all MediaWiki: pages, so it will also list those that aren\'t really messages such as [[MediaWiki:Common.js|Common.js]].\";'),('en','messages:apihelp-query+allmessages-param-args','s:41:\"Arguments to be substituted into message.\";'),('en','messages:apihelp-query+allmessages-param-filter','s:57:\"Return only messages with names that contain this string.\";'),('en','messages:apihelp-query+allmessages-param-customised','s:49:\"Return only messages in this customisation state.\";'),('en','messages:apihelp-query+allmessages-param-lang','s:33:\"Return messages in this language.\";'),('en','messages:apihelp-query+allmessages-param-from','s:41:\"Return messages starting at this message.\";'),('en','messages:apihelp-query+allmessages-param-to','s:39:\"Return messages ending at this message.\";'),('en','messages:apihelp-query+allmessages-param-title','s:77:\"Page name to use as context when parsing message (for $1enableparser option).\";'),('en','messages:apihelp-query+allmessages-param-prefix','s:33:\"Return messages with this prefix.\";'),('en','messages:apihelp-query+allmessages-example-ipb','s:44:\"Show messages starting with <kbd>ipb-</kbd>.\";'),('en','messages:apihelp-query+allmessages-example-de','s:66:\"Show messages <kbd>august</kbd> and <kbd>mainpage</kbd> in German.\";'),('en','messages:apihelp-query+allpages-description','s:54:\"Enumerate all pages sequentially in a given namespace.\";'),('en','messages:apihelp-query+allpages-param-from','s:41:\"The page title to start enumerating from.\";'),('en','messages:apihelp-query+allpages-param-to','s:38:\"The page title to stop enumerating at.\";'),('en','messages:apihelp-query+allpages-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+allpages-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+allpages-param-filterredir','s:20:\"Which pages to list.\";'),('en','messages:apihelp-query+allpages-param-minsize','s:45:\"Limit to pages with at least this many bytes.\";'),('en','messages:apihelp-query+allpages-param-maxsize','s:44:\"Limit to pages with at most this many bytes.\";'),('en','messages:apihelp-query+allpages-param-prtype','s:30:\"Limit to protected pages only.\";'),('en','messages:apihelp-query+allpages-param-prlevel','s:85:\"Filter protections based on protection level (must be used with $1prtype= parameter).\";'),('en','messages:apihelp-query+allpages-param-prfiltercascade','s:76:\"Filter protections based on cascadingness (ignored when $1prtype isn\'t set).\";'),('en','messages:apihelp-query+allpages-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+allpages-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+allpages-param-filterlanglinks','s:108:\"Filter based on whether a page has langlinks. Note that this may not consider langlinks added by extensions.\";'),('en','messages:apihelp-query+allpages-param-prexpiry','s:223:\"Which protection expiry to filter the page on:\n;indefinite:Get only pages with indefinite protection expiry.\n;definite:Get only pages with a definite (specific) protection expiry.\n;all:Get pages with any protections expiry.\";'),('en','messages:apihelp-query+allpages-example-B','s:57:\"Show a list of pages starting at the letter <kbd>B</kbd>.\";'),('en','messages:apihelp-query+allpages-example-generator','s:60:\"Show info about 4 pages starting at the letter <kbd>T</kbd>.\";'),('en','messages:apihelp-query+allpages-example-generator-revisions','s:70:\"Show content of first 2 non-redirect pages beginning at <kbd>Re</kbd>.\";'),('en','messages:apihelp-query+allredirects-description','s:34:\"List all redirects to a namespace.\";'),('en','messages:apihelp-query+allredirects-param-from','s:52:\"The title of the redirect to start enumerating from.\";'),('en','messages:apihelp-query+allredirects-param-to','s:49:\"The title of the redirect to stop enumerating at.\";'),('en','messages:apihelp-query+allredirects-param-prefix','s:55:\"Search for all target pages that begin with this value.\";'),('en','messages:apihelp-query+allredirects-param-unique','s:154:\"Only show distinct target pages. Cannot be used with $1prop=ids|fragment|interwiki.\nWhen used as a generator, yields target pages instead of source pages.\";'),('en','messages:apihelp-query+allredirects-param-prop','s:370:\"Which pieces of information to include:\n;ids:Adds the page ID of the redirecting page (cannot be used with <var>$1unique</var>).\n;title:Adds the title of the redirect.\n;fragment:Adds the fragment from the redirect, if any (cannot be used with <var>$1unique</var>).\n;interwiki:Adds the interwiki prefix from the redirect, if any (cannot be used with <var>$1unique</var>).\";'),('en','messages:apihelp-query+allredirects-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+allredirects-param-limit','s:31:\"How many total items to return.\";'),('en','messages:apihelp-query+allredirects-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+allredirects-example-B','s:97:\"List target pages, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('en','messages:apihelp-query+allredirects-example-unique','s:25:\"List unique target pages.\";'),('en','messages:apihelp-query+allredirects-example-unique-generator','s:48:\"Gets all target pages, marking the missing ones.\";'),('en','messages:apihelp-query+allredirects-example-generator','s:36:\"Gets pages containing the redirects.\";'),('en','messages:apihelp-query+alltransclusions-description','s:96:\"List all transclusions (pages embedded using &#123;&#123;x&#125;&#125;), including non-existing.\";'),('en','messages:apihelp-query+alltransclusions-param-from','s:56:\"The title of the transclusion to start enumerating from.\";'),('en','messages:apihelp-query+alltransclusions-param-to','s:53:\"The title of the transclusion to stop enumerating at.\";'),('en','messages:apihelp-query+alltransclusions-param-prefix','s:61:\"Search for all transcluded titles that begin with this value.\";'),('en','messages:apihelp-query+alltransclusions-param-unique','s:141:\"Only show distinct transcluded titles. Cannot be used with $1prop=ids.\nWhen used as a generator, yields target pages instead of source pages.\";'),('en','messages:apihelp-query+alltransclusions-param-prop','s:161:\"Which pieces of information to include:\n;ids:Adds the page ID of the transcluding page (cannot be used with $1unique).\n;title:Adds the title of the transclusion.\";'),('en','messages:apihelp-query+alltransclusions-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+alltransclusions-param-limit','s:31:\"How many total items to return.\";'),('en','messages:apihelp-query+alltransclusions-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+alltransclusions-example-B','s:103:\"List transcluded titles, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('en','messages:apihelp-query+alltransclusions-example-unique','s:31:\"List unique transcluded titles.\";'),('en','messages:apihelp-query+alltransclusions-example-unique-generator','s:54:\"Gets all transcluded titles, marking the missing ones.\";'),('en','messages:apihelp-query+alltransclusions-example-generator','s:40:\"Gets pages containing the transclusions.\";'),('en','messages:apihelp-query+allusers-description','s:31:\"Enumerate all registered users.\";'),('en','messages:apihelp-query+allusers-param-from','s:40:\"The user name to start enumerating from.\";'),('en','messages:apihelp-query+allusers-param-to','s:37:\"The user name to stop enumerating at.\";'),('en','messages:apihelp-query+allusers-param-prefix','s:48:\"Search for all users that begin with this value.\";'),('en','messages:apihelp-query+allusers-param-dir','s:21:\"Direction to sort in.\";'),('en','messages:apihelp-query+allusers-param-group','s:39:\"Only include users in the given groups.\";'),('en','messages:apihelp-query+allusers-param-excludegroup','s:34:\"Exclude users in the given groups.\";'),('en','messages:apihelp-query+allusers-param-rights','s:141:\"Only include users with the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+allusers-param-prop','s:466:\"Which pieces of information to include:\n;blockinfo:Adds the information about a current block on the user.\n;groups:Lists groups that the user is in. This uses more server resources and may return fewer results than the limit.\n;implicitgroups:Lists all the groups the user is automatically in.\n;rights:Lists rights that the user has.\n;editcount:Adds the edit count of the user.\n;registration:Adds the timestamp of when the user registered if available (may be blank).\";'),('en','messages:apihelp-query+allusers-param-limit','s:36:\"How many total user names to return.\";'),('en','messages:apihelp-query+allusers-param-witheditsonly','s:36:\"Only list users who have made edits.\";'),('en','messages:apihelp-query+allusers-param-activeusers','s:61:\"Only list users active in the last $1 {{PLURAL:$1|day|days}}.\";'),('en','messages:apihelp-query+allusers-example-Y','s:36:\"List users starting at <kbd>Y</kbd>.\";'),('en','messages:apihelp-query+backlinks-description','s:43:\"Find all pages that link to the given page.\";'),('en','messages:apihelp-query+backlinks-param-title','s:66:\"Title to search. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+backlinks-param-pageid','s:67:\"Page ID to search. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+backlinks-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+backlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+backlinks-param-filterredir','s:143:\"How to filter for redirects. If set to <kbd>nonredirects</kbd> when <var>$1redirect</var> is enabled, this is only applied to the second level.\";'),('en','messages:apihelp-query+backlinks-param-limit','s:175:\"How many total pages to return. If <var>$1redirect</var> is enabled, limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('en','messages:apihelp-query+backlinks-param-redirect','s:106:\"If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved.\";'),('en','messages:apihelp-query+backlinks-example-simple','s:34:\"Show links to <kbd>Main page<kbd>.\";'),('en','messages:apihelp-query+backlinks-example-generator','s:59:\"Get information about pages linking to <kbd>Main page<kbd>.\";'),('en','messages:apihelp-query+blocks-description','s:40:\"List all blocked users and IP addresses.\";'),('en','messages:apihelp-query+blocks-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+blocks-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+blocks-param-ids','s:37:\"List of block IDs to list (optional).\";'),('en','messages:apihelp-query+blocks-param-users','s:39:\"List of users to search for (optional).\";'),('en','messages:apihelp-query+blocks-param-ip','s:184:\"Get all blocks applying to this IP or CIDR range, including range blocks.\nCannot be used together with <var>$3users</var>. CIDR ranges broader than IPv4/$1 or IPv6/$2 are not accepted.\";'),('en','messages:apihelp-query+blocks-param-limit','s:37:\"The maximum number of blocks to list.\";'),('en','messages:apihelp-query+blocks-param-prop','s:507:\"Which properties to get:\n;id:Adds the ID of the block.\n;user:Adds the username of the blocked user.\n;userid:Adds the user ID of the blocked user.\n;by:Adds the username of the blocking user.\n;byid:Adds the user ID of the blocking user.\n;timestamp:Adds the timestamp of when the block was given.\n;expiry:Adds the timestamp of when the block expires.\n;reason:Adds the reason given for the block.\n;range:Adds the range of IP addresses affected by the block.\n;flags:Tags the ban with (autoblock, anononly, etc.).\";'),('en','messages:apihelp-query+blocks-param-show','s:133:\"Show only items that meet these criteria.\nFor example, to see only indefinite blocks on IP addresses, set <kbd>$1show=ip|!temp</kbd>.\";'),('en','messages:apihelp-query+blocks-example-simple','s:12:\"List blocks.\";'),('en','messages:apihelp-query+blocks-example-users','s:57:\"List blocks of users <kbd>Alice</kbd> and <kbd>Bob</kbd>.\";'),('en','messages:apihelp-query+categories-description','s:40:\"List all categories the pages belong to.\";'),('en','messages:apihelp-query+categories-param-prop','s:285:\"Which additional properties to get for each category:\n;sortkey:Adds the sortkey (hexadecimal string) and sortkey prefix (human-readable part) for the category.\n;timestamp:Adds timestamp of when the category was added.\n;hidden:Tags categories that are hidden with _&#95;HIDDENCAT_&#95;.\";'),('en','messages:apihelp-query+categories-param-show','s:33:\"Which kind of categories to show.\";'),('en','messages:apihelp-query+categories-param-limit','s:30:\"How many categories to return.\";'),('en','messages:apihelp-query+categories-param-categories','s:96:\"Only list these categories. Useful for checking whether a certain page is in a certain category.\";'),('en','messages:apihelp-query+categories-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+categories-example-simple','s:72:\"Get a list of categories the page <kbd>Albert Einstein</kbd> belongs to.\";'),('en','messages:apihelp-query+categories-example-generator','s:81:\"Get information about all categories used in the page <kbd>Albert Einstein</kbd>.\";'),('en','messages:apihelp-query+categoryinfo-description','s:47:\"Returns information about the given categories.\";'),('en','messages:apihelp-query+categoryinfo-example-simple','s:74:\"Get information about <kbd>Category:Foo</kbd> and <kbd>Category:Bar</kbd>.\";'),('en','messages:apihelp-query+categorymembers-description','s:35:\"List all pages in a given category.\";'),('en','messages:apihelp-query+categorymembers-param-title','s:142:\"Which category to enumerate (required). Must include the <kbd>{{ns:category}}:</kbd> prefix. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+categorymembers-param-pageid','s:86:\"Page ID of the category to enumerate. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+categorymembers-param-prop','s:448:\"Which pieces of information to include:\n;ids:Adds the page ID.\n;title:Adds the title and namespace ID of the page.\n;sortkey:Adds the sortkey used for sorting in the category (hexadecimal string).\n;sortkeyprefix:Adds the sortkey prefix used for sorting in the category (human-readable part of the sortkey).\n;type:Adds the type that the page has been categorised as (page, subcat or file).\n;timestamp:Adds the timestamp of when the page was included.\";'),('en','messages:apihelp-query+categorymembers-param-namespace','s:166:\"Only include pages in these namespaces. Note that <kbd>$1type=subcat</kbd> or <kbd>$1type=file</kbd> may be used instead of <kbd>$1namespace=14</kbd> or <kbd>6</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-type','s:91:\"Which type of category members to include. Ignored when <kbd>$1sort=timestamp</kbd> is set.\";'),('en','messages:apihelp-query+categorymembers-param-limit','s:38:\"The maximum number of pages to return.\";'),('en','messages:apihelp-query+categorymembers-param-sort','s:20:\"Property to sort by.\";'),('en','messages:apihelp-query+categorymembers-param-dir','s:27:\"In which direction to sort.\";'),('en','messages:apihelp-query+categorymembers-param-start','s:83:\"Timestamp to start listing from. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-end','s:79:\"Timestamp to end listing at. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-starthexsortkey','s:121:\"Sortkey to start listing from, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-endhexsortkey','s:119:\"Sortkey to end listing from, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-startsortkeyprefix','s:126:\"Sortkey prefix to start listing from. Can only be used with <kbd>$1sort=sortkey</kbd>. Overrides <var>$1starthexsortkey</var>.\";'),('en','messages:apihelp-query+categorymembers-param-endsortkeyprefix','s:158:\"Sortkey prefix to end listing BEFORE (not at, if this value occurs it will not be included!). Can only be used with $1sort=sortkey. Overrides $1endhexsortkey.\";'),('en','messages:apihelp-query+categorymembers-param-startsortkey','s:30:\"Use $1starthexsortkey instead.\";'),('en','messages:apihelp-query+categorymembers-param-endsortkey','s:28:\"Use $1endhexsortkey instead.\";'),('en','messages:apihelp-query+categorymembers-example-simple','s:50:\"Get first 10 pages in <kbd>Category:Physics</kbd>.\";'),('en','messages:apihelp-query+categorymembers-example-generator','s:66:\"Get page info about first 10 pages in <kbd>Category:Physics</kbd>.\";'),('en','messages:apihelp-query+contributors-description','s:89:\"Get the list of logged-in contributors and the count of anonymous contributors to a page.\";'),('en','messages:apihelp-query+contributors-param-group','s:121:\"Only include users in the given groups. Does not include implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-excludegroup','s:116:\"Exclude users in the given groups. Does not include implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-rights','s:143:\"Only include users having the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-excluderights','s:138:\"Exclude users having the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-limit','s:32:\"How many contributors to return.\";'),('en','messages:apihelp-query+contributors-example-simple','s:51:\"Show contributors to the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+deletedrevisions-description','s:271:\"Get deleted revision information.\n\nMay be used in several ways:\n# Get deleted revisions for a set of pages, by setting titles or pageids. Ordered by title and timestamp.\n# Get data about a set of deleted revisions by setting their IDs with revids. Ordered by revision ID.\";'),('en','messages:apihelp-query+deletedrevisions-param-start','s:88:\"The timestamp to start enumerating from. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-end','s:85:\"The timestamp to stop enumerating at. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevisions-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-param-limit','s:40:\"The maximum amount of revisions to list.\";'),('en','messages:apihelp-query+deletedrevisions-param-prop','s:540:\"Which properties to get:\n;revid:Adds the revision ID of the deleted revision.\n;parentid:Adds the revision ID of the previous revision to the page.\n;user:Adds the user who made the revision.\n;userid:Adds the user ID who made the revision.\n;comment:Adds the comment of the revision.\n;parsedcomment:Adds the parsed comment of the revision.\n;minor:Tags if the revision is minor.\n;len:Adds the length (bytes) of the revision.\n;sha1:Adds the SHA-1 (base 16) of the revision.\n;content:Adds the content of the revision.\n;tags:Tags for the revision.\";'),('en','messages:apihelp-query+deletedrevisions-example-titles','s:105:\"List the deleted revisions of the pages <kbd>Main Page</kbd> and <kbd>Talk:Main Page</kbd>, with content.\";'),('en','messages:apihelp-query+deletedrevisions-example-revids','s:60:\"List the information for deleted revision <kbd>123456</kbd>.\";'),('en','messages:apihelp-query+deletedrevs-description','s:403:\"List deleted revisions.\n\nOperates in three modes:\n# List deleted revisions for the given titles, sorted by timestamp.\n# List deleted contributions for the given user, sorted by timestamp (no titles specified).\n# List all deleted revisions in the given namespace, sorted by title and timestamp (no titles specified, $1user not set).\n\nCertain parameters only apply to some modes and are ignored in others.\";'),('en','messages:apihelp-query+deletedrevs-paraminfo-modes','s:28:\"{{PLURAL:$1|Mode|Modes}}: $2\";'),('en','messages:apihelp-query+deletedrevs-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+deletedrevs-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+deletedrevs-param-from','s:28:\"Start listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-to','s:27:\"Stop listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+deletedrevs-param-unique','s:37:\"List only one revision for each page.\";'),('en','messages:apihelp-query+deletedrevs-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevs-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-param-namespace','s:34:\"Only list pages in this namespace.\";'),('en','messages:apihelp-query+deletedrevs-param-limit','s:40:\"The maximum amount of revisions to list.\";'),('en','messages:apihelp-query+deletedrevs-param-prop','s:622:\"Which properties to get:\n;revid:Adds the revision ID of the deleted revision.\n;parentid:Adds the revision ID of the previous revision to the page.\n;user:Adds the user who made the revision.\n;userid:Adds the user ID whom made the revision.\n;comment:Adds the comment of the revision.\n;parsedcomment:Adds the parsed comment of the revision.\n;minor:Tags if the revision is minor.\n;len:Adds the length (bytes) of the revision.\n;sha1:Adds the SHA-1 (base 16) of the revision.\n;content:Adds the content of the revision.\n;token:<span class=\"apihelp-deprecated\">Deprecated.</span> Gives the edit token.\n;tags:Tags for the revision.\";'),('en','messages:apihelp-query+deletedrevs-example-mode1','s:119:\"List the last deleted revisions of the pages <kbd>Main Page</kbd> and <kbd>Talk:Main Page</kbd>, with content (mode 1).\";'),('en','messages:apihelp-query+deletedrevs-example-mode2','s:66:\"List the last 50 deleted contributions by <kbd>Bob</kbd> (mode 2).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-main','s:67:\"List the first 50 deleted revisions in the main namespace (mode 3).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-talk','s:70:\"List the first 50 deleted pages in the {{ns:talk}} namespace (mode 3).\";'),('en','messages:apihelp-query+disabled-description','s:36:\"This query module has been disabled.\";'),('en','messages:apihelp-query+duplicatefiles-description','s:75:\"List all files that are duplicates of the given files based on hash values.\";'),('en','messages:apihelp-query+duplicatefiles-param-limit','s:35:\"How many duplicate files to return.\";'),('en','messages:apihelp-query+duplicatefiles-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+duplicatefiles-param-localonly','s:44:\"Look only for files in the local repository.\";'),('en','messages:apihelp-query+duplicatefiles-example-simple','s:58:\"Look for duplicates of [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+duplicatefiles-example-generated','s:33:\"Look for duplicates of all files.\";'),('en','messages:apihelp-query+embeddedin-description','s:55:\"Find all pages that embed (transclude) the given title.\";'),('en','messages:apihelp-query+embeddedin-param-title','s:55:\"Title to search. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-query+embeddedin-param-pageid','s:56:\"Page ID to search. Cannot be used together with $1title.\";'),('en','messages:apihelp-query+embeddedin-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+embeddedin-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+embeddedin-param-filterredir','s:28:\"How to filter for redirects.\";'),('en','messages:apihelp-query+embeddedin-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+embeddedin-example-simple','s:49:\"Show pages transcluding <kbd>Template:Stub</kbd>.\";'),('en','messages:apihelp-query+embeddedin-example-generator','s:66:\"Get information about pages transcluding <kbd>Template:Stub</kbd>.\";'),('en','messages:apihelp-query+extlinks-description','s:64:\"Returns all external URLs (not interwikis) from the given pages.\";'),('en','messages:apihelp-query+extlinks-param-limit','s:25:\"How many links to return.\";'),('en','messages:apihelp-query+extlinks-param-protocol','s:166:\"Protocol of the URL. If empty and <var>$1query</var> is set, the protocol is <kbd>http</kbd>. Leave both this and <var>$1query</var> empty to list all external links.\";'),('en','messages:apihelp-query+extlinks-param-query','s:107:\"Search string without protocol. Useful for checking whether a certain page contains a certain external url.\";'),('en','messages:apihelp-query+extlinks-param-expandurl','s:58:\"Expand protocol-relative URLs with the canonical protocol.\";'),('en','messages:apihelp-query+extlinks-example-simple','s:52:\"Get a list of external links on <kbd>Main Page<kbd>.\";'),('en','messages:apihelp-query+exturlusage-description','s:41:\"Enumerate pages that contain a given URL.\";'),('en','messages:apihelp-query+exturlusage-param-prop','s:153:\"Which pieces of information to include:\n;ids:Adds the ID of page.\n;title:Adds the title and namespace ID of the page.\n;url:Adds the URL used in the page.\";'),('en','messages:apihelp-query+exturlusage-param-protocol','s:163:\"Protocol of the URL. If empty and <var>$1query</var> set, the protocol is <kbd>http</kbd>. Leave both this and <var>$1query</var> empty to list all external links.\";'),('en','messages:apihelp-query+exturlusage-param-query','s:99:\"Search string without protocol. See [[Special:LinkSearch]]. Leave empty to list all external links.\";'),('en','messages:apihelp-query+exturlusage-param-namespace','s:33:\"The page namespaces to enumerate.\";'),('en','messages:apihelp-query+exturlusage-param-limit','s:25:\"How many pages to return.\";'),('en','messages:apihelp-query+exturlusage-param-expandurl','s:58:\"Expand protocol-relative URLs with the canonical protocol.\";'),('en','messages:apihelp-query+exturlusage-example-simple','s:58:\"Show pages linking to <kbd>http://www.mediawiki.org</kbd>.\";'),('en','messages:apihelp-query+filearchive-description','s:41:\"Enumerate all deleted files sequentially.\";'),('en','messages:apihelp-query+filearchive-param-from','s:42:\"The image title to start enumerating from.\";'),('en','messages:apihelp-query+filearchive-param-to','s:39:\"The image title to stop enumerating at.\";'),('en','messages:apihelp-query+filearchive-param-prefix','s:55:\"Search for all image titles that begin with this value.\";'),('en','messages:apihelp-query+filearchive-param-limit','s:35:\"How many images to return in total.\";'),('en','messages:apihelp-query+filearchive-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+filearchive-param-sha1','s:43:\"SHA1 hash of image. Overrides $1sha1base36.\";'),('en','messages:apihelp-query+filearchive-param-sha1base36','s:50:\"SHA1 hash of image in base 36 (used in MediaWiki).\";'),('en','messages:apihelp-query+filearchive-param-prop','s:657:\"Which image information to get:\n;sha1:Adds SHA-1 hash for the image.\n;timestamp:Adds timestamp for the uploaded version.\n;user:Adds user who uploaded the image version.\n;size:Adds the size of the image in bytes and the height, width and page count (if applicable).\n;dimensions:Alias for size.\n;description:Adds description the image version.\n;parseddescription:Parse the description on the version.\n;mime:Adds MIME of the image.\n;mediatype:Adds the media type of the image.\n;metadata:Lists Exif metadata for the version of the image.\n;bitdepth:Adds the bit depth of the version.\n;archivename:Adds the filename of the archive version for non-latest versions.\";'),('en','messages:apihelp-query+filearchive-example-simple','s:33:\"Show a list of all deleted files.\";'),('en','messages:apihelp-query+filerepoinfo-description','s:72:\"Return meta information about image repositories configured on the wiki.\";'),('en','messages:apihelp-query+filerepoinfo-param-prop','s:490:\"Which repository properties to get (there may be more available on some wikis):\n;apiurl:URL to the repository API - helpful for getting image info from the host.\n;name:The key of the repository - used in e.g. <var>[[mw:Manual:$wgForeignFileRepos|$wgForeignFileRepos]]</var> and [[Special:ApiHelp/query+imageinfo|imageinfo]] return values.\n;displayname:The human-readable name of the repository wiki.\n;rooturl:Root URL for image paths.\n;local:Whether that repository is the local one or not.\";'),('en','messages:apihelp-query+filerepoinfo-example-simple','s:40:\"Get information about file repositories.\";'),('en','messages:apihelp-query+fileusage-description','s:40:\"Find all pages that use the given files.\";'),('en','messages:apihelp-query+fileusage-param-prop','s:123:\"Which properties to get:\n;pageid:Page ID of each page.\n;title:Title of each page.\n;redirect:Flag if the page is a redirect.\";'),('en','messages:apihelp-query+fileusage-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+fileusage-param-limit','s:19:\"How many to return.\";'),('en','messages:apihelp-query+fileusage-param-show','s:108:\"Show only items that meet these criteria:\n;redirect:Only show redirects.\n;!redirect:Only show non-redirects.\";'),('en','messages:apihelp-query+fileusage-example-simple','s:48:\"Get a list of pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+fileusage-example-generator','s:56:\"Get information about pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+imageinfo-description','s:44:\"Returns file information and upload history.\";'),('en','messages:apihelp-query+imageinfo-param-prop','s:30:\"Which file information to get:\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-timestamp','s:40:\"Adds timestamp for the uploaded version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-user','s:45:\"Adds the user who uploaded each file version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-userid','s:48:\"Add the user ID that uploaded each file version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-comment','s:23:\"Comment on the version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-parsedcomment','s:33:\"Parse the comment on the version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-canonicaltitle','s:37:\"Adds the canonical title of the file.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-url','s:47:\"Gives URL to the file and the description page.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-size','s:88:\"Adds the size of the file in bytes and the height, width and page count (if applicable).\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-dimensions','s:15:\"Alias for size.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-sha1','s:29:\"Adds SHA-1 hash for the file.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-mime','s:27:\"Adds MIME type of the file.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-thumbmime','s:74:\"Adds MIME type of the image thumbnail (requires url and param $1urlwidth).\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-mediatype','s:32:\"Adds the media type of the file.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-metadata','s:48:\"Lists Exif metadata for the version of the file.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-commonmetadata','s:63:\"Lists file format generic metadata for the version of the file.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-extmetadata','s:84:\"Lists formatted metadata combined from multiple sources. Results are HTML formatted.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-archivename','s:65:\"Adds the filename of the archive version for non-latest versions.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-bitdepth','s:34:\"Adds the bit depth of the version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-uploadwarning','s:119:\"Used by the Special:Upload page to get information about an existing file. Not intended for use outside MediaWiki core.\";'),('en','messages:apihelp-query+imageinfo-param-limit','s:43:\"How many file revisions to return per file.\";'),('en','messages:apihelp-query+imageinfo-param-start','s:32:\"Timestamp to start listing from.\";'),('en','messages:apihelp-query+imageinfo-param-end','s:29:\"Timestamp to stop listing at.\";'),('en','messages:apihelp-query+imageinfo-param-urlwidth','s:174:\"If $2prop=url is set, a URL to an image scaled to this width will be returned.\nFor performance reasons if this option is used, no more than $1 scaled images will be returned.\";'),('en','messages:apihelp-query+imageinfo-param-urlheight','s:22:\"Similar to $1urlwidth.\";'),('en','messages:apihelp-query+imageinfo-param-metadataversion','s:136:\"Version of metadata to use. If <kbd>latest</kbd> is specified, use latest version. Defaults to <kbd>1</kbd> for backwards compatibility.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatalanguage','s:180:\"What language to fetch extmetadata in. This affects both which translation to fetch, if multiple are available, as well as how things like numbers and various values are formatted.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatamultilang','s:74:\"If translations for extmetadata property are available, fetch all of them.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatafilter','s:84:\"If specified and non-empty, only these keys will be returned for $1prop=extmetadata.\";'),('en','messages:apihelp-query+imageinfo-param-urlparam','s:170:\"A handler specific parameter string. For example, PDFs might use <kbd>page15-100px</kbd>. <var>$1urlwidth</var> must be used and be consistent with <var>$1urlparam</var>.\";'),('en','messages:apihelp-query+imageinfo-param-localonly','s:44:\"Look only for files in the local repository.\";'),('en','messages:apihelp-query+imageinfo-example-simple','s:82:\"Fetch information about the current version of [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+imageinfo-example-dated','s:75:\"Fetch information about versions of [[:File:Test.jpg]] from 2008 and later.\";'),('en','messages:apihelp-query+images-description','s:47:\"Returns all files contained on the given pages.\";'),('en','messages:apihelp-query+images-param-limit','s:25:\"How many files to return.\";'),('en','messages:apihelp-query+images-param-images','s:85:\"Only list these files. Useful for checking whether a certain page has a certain file.\";'),('en','messages:apihelp-query+images-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+images-example-simple','s:46:\"Get a list of files used in the [[Main Page]].\";'),('en','messages:apihelp-query+images-example-generator','s:58:\"Get information about all files used in the [[Main Page]].\";'),('en','messages:apihelp-query+imageusage-description','s:46:\"Find all pages that use the given image title.\";'),('en','messages:apihelp-query+imageusage-param-title','s:55:\"Title to search. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-query+imageusage-param-pageid','s:56:\"Page ID to search. Cannot be used together with $1title.\";'),('en','messages:apihelp-query+imageusage-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+imageusage-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+imageusage-param-filterredir','s:121:\"How to filter for redirects. If set to nonredirects when $1redirect is enabled, this is only applied to the second level.\";'),('en','messages:apihelp-query+imageusage-param-limit','s:179:\"How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('en','messages:apihelp-query+imageusage-param-redirect','s:106:\"If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved.\";'),('en','messages:apihelp-query+imageusage-example-simple','s:52:\"Show pages using [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+imageusage-example-generator','s:69:\"Get information about pages using [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+info-description','s:27:\"Get basic page information.\";'),('en','messages:apihelp-query+info-param-prop','s:35:\"Which additional properties to get:\";'),('en','messages:apihelp-query+info-paramvalue-prop-protection','s:39:\"List the protection level of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-talkid','s:52:\"The page ID of the talk page for each non-talk page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-watched','s:37:\"List the watched status of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-watchers','s:35:\"The number of watchers, if allowed.\";'),('en','messages:apihelp-query+info-paramvalue-prop-notificationtimestamp','s:50:\"The watchlist notification timestamp of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-subjectid','s:50:\"The page ID of the parent page for each talk page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-url','s:67:\"Gives a full URL, an edit URL, and the canonical URL for each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-readable','s:36:\"Whether the user can read this page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-preload','s:47:\"Gives the text returned by EditFormPreloadText.\";'),('en','messages:apihelp-query+info-paramvalue-prop-displaytitle','s:51:\"Gives the way the page title is actually displayed.\";'),('en','messages:apihelp-query+info-param-testactions','s:70:\"Test whether the current user can perform certain actions on the page.\";'),('en','messages:apihelp-query+info-param-token','s:70:\"Use [[Special:ApiHelp/query+tokens|action=query&meta=tokens]] instead.\";'),('en','messages:apihelp-query+info-example-simple','s:52:\"Get information about the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+info-example-protection','s:75:\"Get general and protection information about the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+iwbacklinks-description','s:208:\"Find all pages that link to the given interwiki link.\n\nCan be used to find all links with a prefix, or all links to a title (with a given prefix). Using neither parameter is effectively \"all interwiki links\".\";'),('en','messages:apihelp-query+iwbacklinks-param-prefix','s:25:\"Prefix for the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-param-title','s:70:\"Interwiki link to search for. Must be used with <var>$1blprefix</var>.\";'),('en','messages:apihelp-query+iwbacklinks-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+iwbacklinks-param-prop','s:110:\"Which properties to get:\n;iwprefix:Adds the prefix of the interwiki.\n;iwtitle:Adds the title of the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+iwbacklinks-example-simple','s:40:\"Get pages linking to [[wikibooks:Test]].\";'),('en','messages:apihelp-query+iwbacklinks-example-generator','s:58:\"Get information about pages linking to [[wikibooks:Test]].\";'),('en','messages:apihelp-query+iwlinks-description','s:49:\"Returns all interwiki links from the given pages.\";'),('en','messages:apihelp-query+iwlinks-param-url','s:57:\"Whether to get the full URL (cannot be used with $1prop).\";'),('en','messages:apihelp-query+iwlinks-param-prop','s:87:\"Which additional properties to get for each interlanguage link:\n;url:Adds the full URL.\";'),('en','messages:apihelp-query+iwlinks-param-limit','s:35:\"How many interwiki links to return.\";'),('en','messages:apihelp-query+iwlinks-param-prefix','s:45:\"Only return interwiki links with this prefix.\";'),('en','messages:apihelp-query+iwlinks-param-title','s:68:\"Interwiki link to search for. Must be used with <var>$1prefix</var>.\";'),('en','messages:apihelp-query+iwlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+iwlinks-example-simple','s:55:\"Get interwiki links from the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+langbacklinks-description','s:284:\"Find all pages that link to the given language link.\n\nCan be used to find all links with a language code, or all links to a title (with a given language). Using neither parameter is effectively \"all language links\".\n\nNote that this may not consider language links added by extensions.\";'),('en','messages:apihelp-query+langbacklinks-param-lang','s:31:\"Language for the language link.\";'),('en','messages:apihelp-query+langbacklinks-param-title','s:54:\"Language link to search for. Must be used with $1lang.\";'),('en','messages:apihelp-query+langbacklinks-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+langbacklinks-param-prop','s:123:\"Which properties to get:\n;lllang:Adds the language code of the language link.\n;lltitle:Adds the title of the language link.\";'),('en','messages:apihelp-query+langbacklinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+langbacklinks-example-simple','s:34:\"Get pages linking to [[:fr:Test]].\";'),('en','messages:apihelp-query+langbacklinks-example-generator','s:52:\"Get information about pages linking to [[:fr:Test]].\";'),('en','messages:apihelp-query+langlinks-description','s:53:\"Returns all interlanguage links from the given pages.\";'),('en','messages:apihelp-query+langlinks-param-limit','s:29:\"How many langlinks to return.\";'),('en','messages:apihelp-query+langlinks-param-url','s:68:\"Whether to get the full URL (cannot be used with <var>$1prop</var>).\";'),('en','messages:apihelp-query+langlinks-param-prop','s:242:\"Which additional properties to get for each interlanguage link:\n;url:Adds the full URL.\n;langname:Adds the localised language name (best effort). Use <var>$1inlanguagecode</var> to control the language.\n;autonym:Adds the native language name.\";'),('en','messages:apihelp-query+langlinks-param-lang','s:51:\"Only return language links with this language code.\";'),('en','messages:apihelp-query+langlinks-param-title','s:56:\"Link to search for. Must be used with <var>$1lang</var>.\";'),('en','messages:apihelp-query+langlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+langlinks-param-inlanguagecode','s:43:\"Language code for localised language names.\";'),('en','messages:apihelp-query+langlinks-example-simple','s:59:\"Get interlanguage links from the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+links-description','s:39:\"Returns all links from the given pages.\";'),('en','messages:apihelp-query+links-param-namespace','s:36:\"Show links in these namespaces only.\";'),('en','messages:apihelp-query+links-param-limit','s:25:\"How many links to return.\";'),('en','messages:apihelp-query+links-param-titles','s:101:\"Only list links to these titles. Useful for checking whether a certain page links to a certain title.\";'),('en','messages:apihelp-query+links-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+links-example-simple','s:44:\"Get links from the page <kbd>Main Page</kbd>\";'),('en','messages:apihelp-query+links-example-generator','s:70:\"Get information about the link pages in the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+links-example-namespaces','s:95:\"Get links from the page <kbd>Main Page</kbd> in the {{ns:user}} and {{ns:template}} namespaces.\";'),('en','messages:apihelp-query+linkshere-description','s:44:\"Find all pages that link to the given pages.\";'),('en','messages:apihelp-query+linkshere-param-prop','s:123:\"Which properties to get:\n;pageid:Page ID of each page.\n;title:Title of each page.\n;redirect:Flag if the page is a redirect.\";'),('en','messages:apihelp-query+linkshere-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+linkshere-param-limit','s:19:\"How many to return.\";'),('en','messages:apihelp-query+linkshere-param-show','s:108:\"Show only items that meet these criteria:\n;redirect:Only show redirects.\n;!redirect:Only show non-redirects.\";'),('en','messages:apihelp-query+linkshere-example-simple','s:49:\"Get a list of pages linking to the [[Main Page]].\";'),('en','messages:apihelp-query+linkshere-example-generator','s:57:\"Get information about pages linking to the [[Main Page]].\";'),('en','messages:apihelp-query+logevents-description','s:21:\"Get events from logs.\";'),('en','messages:apihelp-query+logevents-param-prop','s:482:\"Which properties to get:\n;ids:Adds the ID of the log event.\n;title:Adds the title of the page for the log event.\n;type:Adds the type of log event.\n;user:Adds the user responsible for the log event.\n;userid:Adds the user ID who was responsible for the log event.\n;timestamp:Adds the timestamp for the event.\n;comment:Adds the comment of the event.\n;parsedcomment:Adds the parsed comment of the event.\n;details:Lists additional details about the event.\n;tags:Lists tags for the event.\";'),('en','messages:apihelp-query+logevents-param-type','s:37:\"Filter log entries to only this type.\";'),('en','messages:apihelp-query+logevents-param-action','s:157:\"Filter log actions to only this action. Overrides <var>$1type</var>. Wildcard actions like <kbd>action/*</kbd> allows to specify any string for the asterisk.\";'),('en','messages:apihelp-query+logevents-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+logevents-param-end','s:33:\"The timestamp to end enumerating.\";'),('en','messages:apihelp-query+logevents-param-user','s:47:\"Filter entries to those made by the given user.\";'),('en','messages:apihelp-query+logevents-param-title','s:42:\"Filter entries to those related to a page.\";'),('en','messages:apihelp-query+logevents-param-namespace','s:47:\"Filter entries to those in the given namespace.\";'),('en','messages:apihelp-query+logevents-param-prefix','s:43:\"Filter entries that start with this prefix.\";'),('en','messages:apihelp-query+logevents-param-tag','s:45:\"Only list event entries tagged with this tag.\";'),('en','messages:apihelp-query+logevents-param-limit','s:39:\"How many total event entries to return.\";'),('en','messages:apihelp-query+logevents-example-simple','s:23:\"List recent log events.\";'),('en','messages:apihelp-query+pagepropnames-description','s:48:\"List all page property names in use on the wiki.\";'),('en','messages:apihelp-query+pagepropnames-param-limit','s:38:\"The maximum number of names to return.\";'),('en','messages:apihelp-query+pagepropnames-example-simple','s:28:\"Get first 10 property names.\";'),('en','messages:apihelp-query+pageprops-description','s:51:\"Get various properties defined in the page content.\";'),('en','messages:apihelp-query+pageprops-param-prop','s:91:\"Only list these props. Useful for checking whether a certain page uses a certain page prop.\";'),('en','messages:apihelp-query+pageprops-example-simple','s:43:\"Get properties for <kbd>Category:Foo</kbd>.\";'),('en','messages:apihelp-query+pageswithprop-description','s:43:\"List all pages using a given page property.\";'),('en','messages:apihelp-query+pageswithprop-param-propname','s:39:\"Page prop for which to enumerate pages.\";'),('en','messages:apihelp-query+pageswithprop-param-prop','s:154:\"Which pieces of information to include:\n;ids:Adds the page ID.\n;title:Adds the title and namespace ID of the page.\n;value:Adds the value of the page prop.\";'),('en','messages:apihelp-query+pageswithprop-param-limit','s:38:\"The maximum number of pages to return.\";'),('en','messages:apihelp-query+pageswithprop-param-dir','s:27:\"In which direction to sort.\";'),('en','messages:apihelp-query+pageswithprop-example-simple','s:81:\"List the first 10 pages using <code>&#123;&#123;DISPLAYTITLE:&#125;&#125;</code>.\";'),('en','messages:apihelp-query+pageswithprop-example-generator','s:72:\"Get page info about first 10 pages using <code>_&#95;NOTOC_&#95;</code>.\";'),('en','messages:apihelp-query+prefixsearch-description','s:40:\"Perform a prefix search for page titles.\";'),('en','messages:apihelp-query+prefixsearch-param-search','s:14:\"Search string.\";'),('en','messages:apihelp-query+prefixsearch-param-namespace','s:21:\"Namespaces to search.\";'),('en','messages:apihelp-query+prefixsearch-param-limit','s:36:\"Maximum number of results to return.\";'),('en','messages:apihelp-query+prefixsearch-param-offset','s:26:\"Number of results to skip.\";'),('en','messages:apihelp-query+prefixsearch-example-simple','s:57:\"Search for page titles beginning with <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+protectedtitles-description','s:40:\"List all titles protected from creation.\";'),('en','messages:apihelp-query+protectedtitles-param-namespace','s:37:\"Only list titles in these namespaces.\";'),('en','messages:apihelp-query+protectedtitles-param-level','s:46:\"Only list titles with these protection levels.\";'),('en','messages:apihelp-query+protectedtitles-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+protectedtitles-param-start','s:43:\"Start listing at this protection timestamp.\";'),('en','messages:apihelp-query+protectedtitles-param-end','s:42:\"Stop listing at this protection timestamp.\";'),('en','messages:apihelp-query+protectedtitles-param-prop','s:388:\"Which properties to get:\n;timestamp:Adds the timestamp of when protection was added.\n;user:Adds the user that added the protection.\n;userid:Adds the user ID that added the protection.\n;comment:Adds the comment for the protection.\n;parsedcomment:Adds the parsed comment for the protection.\n;expiry:Adds the timestamp of when the protection will be lifted.\n;level:Adds the protection level.\";'),('en','messages:apihelp-query+protectedtitles-example-simple','s:22:\"List protected titles.\";'),('en','messages:apihelp-query+protectedtitles-example-generator','s:53:\"Find links to protected titles in the main namespace.\";'),('en','messages:apihelp-query+querypage-description','s:54:\"Get a list provided by a QueryPage-based special page.\";'),('en','messages:apihelp-query+querypage-param-page','s:59:\"The name of the special page. Note, this is case sensitive.\";'),('en','messages:apihelp-query+querypage-param-limit','s:28:\"Number of results to return.\";'),('en','messages:apihelp-query+querypage-example-ancientpages','s:45:\"Return results from [[Special:Ancientpages]].\";'),('en','messages:apihelp-query+random-description','s:473:\"Get a set of random pages.\n\nPages are listed in a fixed sequence, only the starting point is random. This means that if, for example, <samp>Main Page</samp> is the first random page in the list, <samp>List of fictional monkeys</samp> will <em>always</em> be second, <samp>List of people on stamps of Vanuatu</samp> third, etc.\n\nIf the number of pages in the namespace is lower than <var>$1limit</var>, fewer pages will be returned. The same page will not be returned twice.\";'),('en','messages:apihelp-query+random-param-namespace','s:38:\"Return pages in these namespaces only.\";'),('en','messages:apihelp-query+random-param-limit','s:45:\"Limit how many random pages will be returned.\";'),('en','messages:apihelp-query+random-param-redirect','s:48:\"Load a random redirect instead of a random page.\";'),('en','messages:apihelp-query+random-example-simple','s:48:\"Return two random pages from the main namespace.\";'),('en','messages:apihelp-query+random-example-generator','s:64:\"Return page info about two random pages from the main namespace.\";'),('en','messages:apihelp-query+recentchanges-description','s:25:\"Enumerate recent changes.\";'),('en','messages:apihelp-query+recentchanges-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+recentchanges-param-end','s:33:\"The timestamp to end enumerating.\";'),('en','messages:apihelp-query+recentchanges-param-namespace','s:40:\"Filter changes to only these namespaces.\";'),('en','messages:apihelp-query+recentchanges-param-user','s:31:\"Only list changes by this user.\";'),('en','messages:apihelp-query+recentchanges-param-excludeuser','s:32:\"Don\'t list changes by this user.\";'),('en','messages:apihelp-query+recentchanges-param-tag','s:39:\"Only list changes tagged with this tag.\";'),('en','messages:apihelp-query+recentchanges-param-prop','s:779:\"Include additional pieces of information:\n;user:Adds the user responsible for the edit and tags if they are an IP.\n;userid:Adds the user ID responsible for the edit.\n;comment:Adds the comment for the edit.\n;parsedcomment:Adds the parsed comment for the edit.\n;flags:Adds flags for the edit.\n;timestamp:Adds timestamp of the edit.\n;title:Adds the page title of the edit.\n;ids:Adds the page ID, recent changes ID and the new and old revision ID.\n;sizes:Adds the new and old page length in bytes.\n;redirect:Tags edit if page is a redirect.\n;patrolled:Tags patrollable edits as being patrolled or unpatrolled.\n;loginfo:Adds log information (log ID, log type, etc) to log entries.\n;tags:Lists tags for the entry.\n;sha1:Adds the content checksum for entries associated with a revision.\";'),('en','messages:apihelp-query+recentchanges-param-token','s:81:\"Use <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd> instead.\";'),('en','messages:apihelp-query+recentchanges-param-show','s:127:\"Show only items that meet these criteria. For example, to see only minor edits done by logged-in users, set $1show=minor|!anon.\";'),('en','messages:apihelp-query+recentchanges-param-limit','s:33:\"How many total changes to return.\";'),('en','messages:apihelp-query+recentchanges-param-type','s:31:\"Which types of changes to show.\";'),('en','messages:apihelp-query+recentchanges-param-toponly','s:48:\"Only list changes which are the latest revision.\";'),('en','messages:apihelp-query+recentchanges-example-simple','s:20:\"List recent changes.\";'),('en','messages:apihelp-query+recentchanges-example-generator','s:47:\"Get page info about recent unpatrolled changes.\";'),('en','messages:apihelp-query+redirects-description','s:41:\"Returns all redirects to the given pages.\";'),('en','messages:apihelp-query+redirects-param-prop','s:134:\"Which properties to get:\n;pageid:Page ID of each redirect.\n;title:Title of each redirect.\n;fragment:Fragment of each redirect, if any.\";'),('en','messages:apihelp-query+redirects-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+redirects-param-limit','s:29:\"How many redirects to return.\";'),('en','messages:apihelp-query+redirects-param-show','s:139:\"Show only items that meet these criteria:\n;fragment:Only show redirects with a fragment.\n;!fragment:Only show redirects without a fragment.\";'),('en','messages:apihelp-query+redirects-example-simple','s:45:\"Get a list of redirects to the [[Main Page]].\";'),('en','messages:apihelp-query+redirects-example-generator','s:57:\"Get information about all redirects to the [[Main Page]].\";'),('en','messages:apihelp-query+revisions-description','s:294:\"Get revision information.\n\nMay be used in several ways:\n# Get data about a set of pages (last revision), by setting titles or pageids.\n# Get revisions for one given page, by using titles or pageids with start, end, or limit.\n# Get data about a set of revisions by setting their IDs with revids.\";'),('en','messages:apihelp-query+revisions-paraminfo-singlepageonly','s:46:\"May only be used with a single page (mode #2).\";'),('en','messages:apihelp-query+revisions-param-startid','s:44:\"From which revision ID to start enumeration.\";'),('en','messages:apihelp-query+revisions-param-endid','s:46:\"Stop revision enumeration on this revision ID.\";'),('en','messages:apihelp-query+revisions-param-start','s:51:\"From which revision timestamp to start enumeration.\";'),('en','messages:apihelp-query+revisions-param-end','s:31:\"Enumerate up to this timestamp.\";'),('en','messages:apihelp-query+revisions-param-user','s:36:\"Only include revisions made by user.\";'),('en','messages:apihelp-query+revisions-param-excludeuser','s:31:\"Exclude revisions made by user.\";'),('en','messages:apihelp-query+revisions-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+revisions-param-token','s:41:\"Which tokens to obtain for each revision.\";'),('en','messages:apihelp-query+revisions-example-content','s:94:\"Get data with content for the last revision of titles <kbd>API</kbd> and <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-example-last5','s:49:\"Get last 5 revisions of the <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5','s:50:\"Get first 5 revisions of the <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5-after','s:72:\"Get first 5 revisions of the <kbd>Main Page</kbd> made after 2006-05-01.\";'),('en','messages:apihelp-query+revisions-example-first5-not-localhost','s:108:\"Get first 5 revisions of the <kbd>Main Page</kbd> that were not made by anonymous user <kbd>127.0.0.1</kbd>.\";'),('en','messages:apihelp-query+revisions-example-first5-user','s:106:\"Get first 5 revisions of the <kbd>Main Page</kbd> that were made by the user <kbd>MediaWiki default</kbd>.\";'),('en','messages:apihelp-query+revisions+base-param-prop','s:512:\"Which properties to get for each revision:\n;ids:The ID of the revision.\n;flags:Revision flags (minor).\n;timestamp:The timestamp of the revision.\n;user:User that made the revision.\n;userid:User ID of the revision creator.\n;size:Length (bytes) of the revision.\n;sha1:SHA-1 (base 16) of the revision.\n;contentmodel:Content model ID of the revision.\n;comment:Comment by the user for the revision.\n;parsedcomment:Parsed comment by the user for the revision.\n;content:Text of the revision.\n;tags:Tags for the revision.\";'),('en','messages:apihelp-query+revisions+base-param-limit','s:42:\"Limit how many revisions will be returned.\";'),('en','messages:apihelp-query+revisions+base-param-expandtemplates','s:63:\"Expand templates in revision content (requires $1prop=content).\";'),('en','messages:apihelp-query+revisions+base-param-generatexml','s:71:\"Generate XML parse tree for revision content (requires $1prop=content).\";'),('en','messages:apihelp-query+revisions+base-param-parse','s:124:\"Parse revision content (requires $1prop=content). For performance reasons, if this option is used, $1limit is enforced to 1.\";'),('en','messages:apihelp-query+revisions+base-param-section','s:49:\"Only retrieve the content of this section number.\";'),('en','messages:apihelp-query+revisions+base-param-diffto','s:151:\"Revision ID to diff each revision to. Use <kbd>prev</kbd>, <kbd>next</kbd> and <kbd>cur</kbd> for the previous, next and current revision respectively.\";'),('en','messages:apihelp-query+revisions+base-param-difftotext','s:186:\"Text to diff each revision to. Only diffs a limited number of revisions. Overrides <var>$1diffto</var>. If <var>$1section</var> is set, only that section will be diffed against this text\";'),('en','messages:apihelp-query+revisions+base-param-contentformat','s:89:\"Serialization format used for <var>$1difftotext</var> and expected for output of content.\";'),('en','messages:apihelp-query+search-description','s:27:\"Perform a full text search.\";'),('en','messages:apihelp-query+search-param-search','s:61:\"Search for all page titles (or content) that have this value.\";'),('en','messages:apihelp-query+search-param-namespace','s:36:\"Search only within these namespaces.\";'),('en','messages:apihelp-query+search-param-what','s:32:\"Which type of search to perform.\";'),('en','messages:apihelp-query+search-param-info','s:25:\"Which metadata to return.\";'),('en','messages:apihelp-query+search-param-prop','s:664:\"Which properties to return:\n;size:Adds the size of the page in bytes.\n;wordcount:Adds the word count of the page.\n;timestamp:Adds the timestamp of when the page was last edited.\n;snippet:Adds a parsed snippet of the page.\n;titlesnippet:Adds a parsed snippet of the page title.\n;redirectsnippet:Adds a parsed snippet of the redirect title.\n;redirecttitle:Adds the title of the matching redirect.\n;sectionsnippet:Adds a parsed snippet of the matching section title.\n;sectiontitle:Adds the title of the matching section.\n;score:<span class=\"apihelp-deprecated\">Deprecated and ignored.</span>\n;hasrelated:<span class=\"apihelp-deprecated\">Deprecated and ignored.</span>\";'),('en','messages:apihelp-query+search-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+search-param-interwiki','s:54:\"Include interwiki results in the search, if available.\";'),('en','messages:apihelp-query+search-param-backend','s:48:\"Which search backend to use, if not the default.\";'),('en','messages:apihelp-query+search-example-simple','s:30:\"Search for <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+search-example-text','s:36:\"Search texts for <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+search-example-generator','s:75:\"Ger page info about the pages returned for a search for <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+siteinfo-description','s:42:\"Return general information about the site.\";'),('en','messages:apihelp-query+siteinfo-param-prop','s:1562:\"Which information to get:\n;general:Overall system information.\n;namespaces:List of registered namespaces and their canonical names.\n;namespacealiases:List of registered namespace aliases.\n;specialpagealiases:List of special page aliases.\n;magicwords:List of magic words and their aliases.\n;statistics:Returns site statistics.\n;interwikimap:Returns interwiki map (optionally filtered, optionally localised by using <var>$1inlanguagecode</var>).\n;dbrepllag:Returns database server with the highest replication lag.\n;usergroups:Returns user groups and the associated permissions.\n;libraries:Returns libraries installed on the wiki.\n;extensions:Returns extensions installed on the wiki.\n;fileextensions:Returns list of file extensions allowed to be uploaded.\n;rightsinfo:Returns wiki rights (license) information if available.\n;restrictions:Returns information on available restriction (protection) types.\n;languages:Returns a list of languages MediaWiki supports (optionally localised by using <var>$1inlanguagecode</var>).\n;skins:Returns a list of all enabled skins (optionally localised by using <var>$1inlanguagecode</var>, otherwise in the content language).\n;extensiontags:Returns a list of parser extension tags.\n;functionhooks:Returns a list of parser function hooks.\n;showhooks:Returns a list of all subscribed hooks (contents of <var>[[mw:Manual:$wgHooks|$wgHooks]]</var>).\n;variables:Returns a list of variable IDs.\n;protocols:Returns a list of protocols that are allowed in external links.\n;defaultoptions:Returns the default values for user preferences.\";'),('en','messages:apihelp-query+siteinfo-param-filteriw','s:64:\"Return only local or only nonlocal entries of the interwiki map.\";'),('en','messages:apihelp-query+siteinfo-param-showalldb','s:61:\"List all database servers, not just the one lagging the most.\";'),('en','messages:apihelp-query+siteinfo-param-numberingroup','s:41:\"Lists the number of users in user groups.\";'),('en','messages:apihelp-query+siteinfo-param-inlanguagecode','s:72:\"Language code for localised language names (best effort) and skin names.\";'),('en','messages:apihelp-query+siteinfo-example-simple','s:23:\"Fetch site information.\";'),('en','messages:apihelp-query+siteinfo-example-interwiki','s:41:\"Fetch a list of local interwiki prefixes.\";'),('en','messages:apihelp-query+siteinfo-example-replag','s:34:\"Check the current replication lag.\";'),('en','messages:apihelp-query+stashimageinfo-description','s:43:\"Returns file information for stashed files.\";'),('en','messages:apihelp-query+stashimageinfo-param-filekey','s:67:\"Key that identifies a previous upload that was stashed temporarily.\";'),('en','messages:apihelp-query+stashimageinfo-param-sessionkey','s:48:\"Alias for $1filekey, for backward compatibility.\";'),('en','messages:apihelp-query+stashimageinfo-example-simple','s:39:\"Returns information for a stashed file.\";'),('en','messages:apihelp-query+stashimageinfo-example-params','s:41:\"Returns thumbnails for two stashed files.\";'),('en','messages:apihelp-query+tags-description','s:17:\"List change tags.\";'),('en','messages:apihelp-query+tags-param-limit','s:35:\"The maximum number of tags to list.\";'),('en','messages:apihelp-query+tags-param-prop','s:482:\"Which properties to get:\n;name:Adds name of tag.\n;displayname:Adds system message for the tag.\n;description:Adds description of the tag.\n;hitcount:Adds the number of revisions and log entries that have this tag.\n;defined:Indicate whether the tag is defined.\n;source:Gets the sources of the tag, which may include <samp>extension</samp> for extension-defined tags and <samp>manual</samp> for tags that may be applied manually by users.\n;active:Whether the tag is still being applied.\";'),('en','messages:apihelp-query+tags-example-simple','s:20:\"List available tags.\";'),('en','messages:apihelp-query+templates-description','s:49:\"Returns all pages transcluded on the given pages.\";'),('en','messages:apihelp-query+templates-param-namespace','s:39:\"Show templates in this namespaces only.\";'),('en','messages:apihelp-query+templates-param-limit','s:29:\"How many templates to return.\";'),('en','messages:apihelp-query+templates-param-templates','s:94:\"Only list these templates. Useful for checking whether a certain page uses a certain template.\";'),('en','messages:apihelp-query+templates-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+templates-example-simple','s:56:\"Get the templates used on the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+templates-example-generator','s:70:\"Get information about the template pages used on <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+templates-example-namespaces','s:114:\"Get pages in the {{ns:user}} and {{ns:template}} namespaces that are transcluded on the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+tokens-description','s:39:\"Gets tokens for data-modifying actions.\";'),('en','messages:apihelp-query+tokens-param-type','s:26:\"Types of token to request.\";'),('en','messages:apihelp-query+tokens-example-simple','s:36:\"Retrieve a csrf token (the default).\";'),('en','messages:apihelp-query+tokens-example-types','s:42:\"Retrieve a watch token and a patrol token.\";'),('en','messages:apihelp-query+transcludedin-description','s:47:\"Find all pages that transclude the given pages.\";'),('en','messages:apihelp-query+transcludedin-param-prop','s:123:\"Which properties to get:\n;pageid:Page ID of each page.\n;title:Title of each page.\n;redirect:Flag if the page is a redirect.\";'),('en','messages:apihelp-query+transcludedin-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+transcludedin-param-limit','s:19:\"How many to return.\";'),('en','messages:apihelp-query+transcludedin-param-show','s:108:\"Show only items that meet these criteria:\n;redirect:Only show redirects.\n;!redirect:Only show non-redirects.\";'),('en','messages:apihelp-query+transcludedin-example-simple','s:54:\"Get a list of pages transcluding <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+transcludedin-example-generator','s:62:\"Get information about pages transcluding <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+usercontribs-description','s:24:\"Get all edits by a user.\";'),('en','messages:apihelp-query+usercontribs-param-limit','s:46:\"The maximum number of contributions to return.\";'),('en','messages:apihelp-query+usercontribs-param-start','s:35:\"The start timestamp to return from.\";'),('en','messages:apihelp-query+usercontribs-param-end','s:31:\"The end timestamp to return to.\";'),('en','messages:apihelp-query+usercontribs-param-user','s:40:\"The users to retrieve contributions for.\";'),('en','messages:apihelp-query+usercontribs-param-userprefix','s:89:\"Retrieve contributions for all users whose names begin with this value. Overrides $1user.\";'),('en','messages:apihelp-query+usercontribs-param-namespace','s:44:\"Only list contributions in these namespaces.\";'),('en','messages:apihelp-query+usercontribs-param-prop','s:460:\"Include additional pieces of information:\n;ids:Adds the page ID and revision ID.\n;title:Adds the title and namespace ID of the page.\n;timestamp:Adds the timestamp of the edit.\n;comment:Adds the comment of the edit.\n;parsedcomment:Adds the parsed comment of the edit.\n;size:Adds the new size of the edit.\n;sizediff:Adds the size delta of the edit against its parent.\n;flags:Adds flags of the edit.\n;patrolled:Tags patrolled edits.\n;tags:Lists tags for the edit.\";'),('en','messages:apihelp-query+usercontribs-param-show','s:286:\"Show only items that meet these criteria, e.g. non minor edits only: <kbd>$2show=!minor</kbd>.\n\nIf <kbd>$2show=patrolled</kbd> or <kbd>$2show=!patrolled</kbd> is set, revisions older than <var>[[mw:Manual:$wgRCMaxAge|$wgRCMaxAge]]</var> ($1 {{PLURAL:$1|second|seconds}}) won\'t be shown.\";'),('en','messages:apihelp-query+usercontribs-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+usercontribs-param-toponly','s:48:\"Only list changes which are the latest revision.\";'),('en','messages:apihelp-query+usercontribs-example-user','s:46:\"Show contributions of user <kbd>Example</kbd>.\";'),('en','messages:apihelp-query+usercontribs-example-ipprefix','s:73:\"Show contributions from all IP addresses with prefix <kbd>192.0.2.</kbd>.\";'),('en','messages:apihelp-query+userinfo-description','s:39:\"Get information about the current user.\";'),('en','messages:apihelp-query+userinfo-param-prop','s:1135:\"Which pieces of information to include:\n;blockinfo:Tags if the current user is blocked, by whom, and for what reason.\n;hasmsg:Adds a tag <samp>message</samp> if the current user has pending messages.\n;groups:Lists all the groups the current user belongs to.\n;implicitgroups:Lists all the groups the current user is automatically a member of.\n;rights:Lists all the rights the current user has.\n;changeablegroups:Lists the groups the current user can add to and remove from.\n;options:Lists all preferences the current user has set.\n;preferencestoken:<span class=\"apihelp-deprecated\">Deprecated.</span> Get a token to change current user\'s preferences.\n;editcount:Adds the current user\'s edit count.\n;ratelimits:Lists all rate limits applying to the current user.\n;realname:Adds the user\'s real name.\n;email:Adds the user\'s email address and email authentication date.\n;acceptlang:Echoes the <code>Accept-Language</code> header sent by the client in a structured format.\n;registrationdate:Adds the user\'s registration date.\n;unreadcount:Adds the count of unread pages on the user\'s watchlist (maximum $1; returns <samp>$2</samp> if more).\";'),('en','messages:apihelp-query+userinfo-example-simple','s:39:\"Get information about the current user.\";'),('en','messages:apihelp-query+userinfo-example-data','s:50:\"Get additional information about the current user.\";'),('en','messages:apihelp-query+users-description','s:38:\"Get information about a list of users.\";'),('en','messages:apihelp-query+users-param-prop','s:538:\"Which pieces of information to include:\n;blockinfo:Tags if the user is blocked, by whom, and for what reason.\n;groups:Lists all the groups each user belongs to.\n;implicitgroups:Lists all the groups a user is automatically a member of.\n;rights:Lists all the rights each user has.\n;editcount:Adds the user\'s edit count.\n;registration:Adds the user\'s registration timestamp.\n;emailable:Tags if the user can and wants to receive email through [[Special:Emailuser]].\n;gender:Tags the gender of the user. Returns \"male\", \"female\", or \"unknown\".\";'),('en','messages:apihelp-query+users-param-users','s:42:\"A list of users to obtain information for.\";'),('en','messages:apihelp-query+users-param-token','s:81:\"Use <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd> instead.\";'),('en','messages:apihelp-query+users-example-simple','s:47:\"Return information for user <kbd>Example</kbd>.\";'),('en','messages:apihelp-query+watchlist-description','s:60:\"Get recent changes to pages in the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-param-allrev','s:67:\"Include multiple revisions of the same page within given timeframe.\";'),('en','messages:apihelp-query+watchlist-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+watchlist-param-end','s:33:\"The timestamp to end enumerating.\";'),('en','messages:apihelp-query+watchlist-param-namespace','s:44:\"Filter changes to only the given namespaces.\";'),('en','messages:apihelp-query+watchlist-param-user','s:31:\"Only list changes by this user.\";'),('en','messages:apihelp-query+watchlist-param-excludeuser','s:32:\"Don\'t list changes by this user.\";'),('en','messages:apihelp-query+watchlist-param-limit','s:45:\"How many total results to return per request.\";'),('en','messages:apihelp-query+watchlist-param-prop','s:561:\"Which additional items to get:\n;ids:Adds revision IDs and page IDs.\n;title:Adds title of the page.\n;flags:Adds flags for the edit.\n;user:Adds the user who made the edit.\n;userid:Adds user ID of whom made the edit.\n;comment:Adds comment of the edit.\n;parsedcomment:Adds parsed comment of the edit.\n;timestamp:Adds timestamp of the edit.\n;patrol:Tags edits that are patrolled.\n;sizes:Adds the old and new lengths of the page.\n;notificationtimestamp:Adds timestamp of when the user was last notified about the edit.\n;loginfo:Adds log information where appropriate.\";'),('en','messages:apihelp-query+watchlist-param-show','s:127:\"Show only items that meet these criteria. For example, to see only minor edits done by logged-in users, set $1show=minor|!anon.\";'),('en','messages:apihelp-query+watchlist-param-type','s:124:\"Which types of changes to show:\n;edit:Regular page edits.\n;external:External changes.\n;new:Page creations.\n;log:Log entries.\";'),('en','messages:apihelp-query+watchlist-param-owner','s:63:\"Used along with $1token to access a different user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-param-token','s:148:\"A security token (available in the user\'s [[Special:Preferences#mw-prefsection-watchlist|preferences]]) to allow access to another user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-simple','s:81:\"List the top revision for recently changed pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-props','s:111:\"Fetch additional information about the top revision for recently changed pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-allrev','s:84:\"Fetch information about all recent changes to pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-generator','s:75:\"Fetch page info for recently changed pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-generator-rev','s:80:\"Fetch revision info for recent changes to pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-wlowner','s:93:\"List the top revision for recently changed pages on the watchlist of user <kbd>Example</kbd>.\";'),('en','messages:apihelp-query+watchlistraw-description','s:46:\"Get all pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-param-namespace','s:40:\"Only list pages in the given namespaces.\";'),('en','messages:apihelp-query+watchlistraw-param-limit','s:45:\"How many total results to return per request.\";'),('en','messages:apihelp-query+watchlistraw-param-prop','s:110:\"Which additional properties to get:\n;changed:Adds timestamp of when the user was last notified about the edit.\";'),('en','messages:apihelp-query+watchlistraw-param-show','s:41:\"Only list items that meet these criteria.\";'),('en','messages:apihelp-query+watchlistraw-param-owner','s:63:\"Used along with $1token to access a different user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-param-token','s:148:\"A security token (available in the user\'s [[Special:Preferences#mw-prefsection-watchlist|preferences]]) to allow access to another user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-example-simple','s:43:\"List pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-example-generator','s:58:\"Fetch page info for pages on the current user\'s watchlist.\";'),('en','messages:apihelp-revisiondelete-description','s:30:\"Delete and undelete revisions.\";'),('en','messages:apihelp-revisiondelete-param-type','s:42:\"Type of revision deletion being performed.\";'),('en','messages:apihelp-revisiondelete-param-target','s:63:\"Page title for the revision deletion, if required for the type.\";'),('en','messages:apihelp-revisiondelete-param-ids','s:44:\"Identifiers for the revisions to be deleted.\";'),('en','messages:apihelp-revisiondelete-param-hide','s:31:\"What to hide for each revision.\";'),('en','messages:apihelp-revisiondelete-param-show','s:33:\"What to unhide for each revision.\";'),('en','messages:apihelp-revisiondelete-param-suppress','s:63:\"Whether to suppress data from administrators as well as others.\";'),('en','messages:apihelp-revisiondelete-param-reason','s:38:\"Reason for the deletion or undeletion.\";'),('en','messages:apihelp-revisiondelete-example-revision','s:76:\"Hide content for revision <kbd>12345</kbd> on the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-revisiondelete-example-log','s:85:\"Hide all data on log entry <kbd>67890</kbd> with the reason <kbd>BLP violation</kbd>.\";'),('en','messages:apihelp-rollback-description','s:129:\"Undo the last edit to the page.\n\nIf the last user who edited the page made multiple edits in a row, they will all be rolled back.\";'),('en','messages:apihelp-rollback-param-title','s:81:\"Title of the page to roll back. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-rollback-param-pageid','s:82:\"Page ID of the page to roll back. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-rollback-param-user','s:51:\"Name of the user whose edits are to be rolled back.\";'),('en','messages:apihelp-rollback-param-summary','s:60:\"Custom edit summary. If empty, default summary will be used.\";'),('en','messages:apihelp-rollback-param-markbot','s:52:\"Mark the reverted edits and the revert as bot edits.\";'),('en','messages:apihelp-rollback-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-rollback-example-simple','s:81:\"Roll back the last edits to page <kbd>Main Page</kbd> by user <kbd>Example</kbd>.\";'),('en','messages:apihelp-rollback-example-summary','s:180:\"Roll back the last edits to page <kbd>Main Page</kbd> by IP user <kbd>192.0.2.5</kbd> with summary <kbd>Reverting vandalism</kbd>, and mark those edits and the revert as bot edits.\";'),('en','messages:apihelp-rsd-description','s:47:\"Export an RSD (Really Simple Discovery) schema.\";'),('en','messages:apihelp-rsd-example-simple','s:22:\"Export the RSD schema.\";'),('en','messages:apihelp-setnotificationtimestamp-description','s:237:\"Update the notification timestamp for watched pages.\n\nThis affects the highlighting of changed pages in the watchlist and history, and the sending of email when the \"Email me when a page on my watchlist is changed\" preference is enabled.\";'),('en','messages:apihelp-setnotificationtimestamp-param-entirewatchlist','s:26:\"Work on all watched pages.\";'),('en','messages:apihelp-setnotificationtimestamp-param-timestamp','s:53:\"Timestamp to which to set the notification timestamp.\";'),('en','messages:apihelp-setnotificationtimestamp-param-torevid','s:62:\"Revision to set the notification timestamp to (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-param-newerthanrevid','s:70:\"Revision to set the notification timestamp newer than (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-example-all','s:55:\"Reset the notification status for the entire watchlist.\";'),('en','messages:apihelp-setnotificationtimestamp-example-page','s:55:\"Reset the notification status for <kbd>Main page</kbd>.\";'),('en','messages:apihelp-setnotificationtimestamp-example-pagetimestamp','s:103:\"Set the notification timestamp for <kbd>Main page</kbd> so all edits since 1 January 2012 are unviewed.\";'),('en','messages:apihelp-setnotificationtimestamp-example-allpages','s:80:\"Reset the notification status for pages in the <kbd>{{ns:user}}</kbd> namespace.\";'),('en','messages:apihelp-tag-description','s:67:\"Add or remove change tags from individual revisions or log entries.\";'),('en','messages:apihelp-tag-param-rcid','s:67:\"One or more recent changes IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-revid','s:61:\"One or more revision IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-logid','s:62:\"One or more log entry IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-add','s:53:\"Tags to add. Only manually defined tags can be added.\";'),('en','messages:apihelp-tag-param-remove','s:98:\"Tags to remove. Only tags that are either manually defined or completely undefined can be removed.\";'),('en','messages:apihelp-tag-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-tag-example-rev','s:81:\"Add the <kbd>vandalism</kbd> tag from revision ID 123 without specifying a reason\";'),('en','messages:apihelp-tag-example-log','s:95:\"Remove the <kbd>spam</kbd> tag from log entry ID 123 with the reason <kbd>Wrongly applied</kbd>\";'),('en','messages:apihelp-tokens-description','s:136:\"Get tokens for data-modifying actions.\n\nThis module is deprecated in favor of [[Special:ApiHelp/query+tokens|action=query&meta=tokens]].\";'),('en','messages:apihelp-tokens-param-type','s:26:\"Types of token to request.\";'),('en','messages:apihelp-tokens-example-edit','s:37:\"Retrieve an edit token (the default).\";'),('en','messages:apihelp-tokens-example-emailmove','s:41:\"Retrieve an email token and a move token.\";'),('en','messages:apihelp-unblock-description','s:15:\"Unblock a user.\";'),('en','messages:apihelp-unblock-param-id','s:117:\"ID of the block to unblock (obtained through <kbd>list=blocks</kbd>). Cannot be used together with <var>$1user</var>.\";'),('en','messages:apihelp-unblock-param-user','s:90:\"Username, IP address or IP range to unblock. Cannot be used together with <var>$1id</var>.\";'),('en','messages:apihelp-unblock-param-reason','s:19:\"Reason for unblock.\";'),('en','messages:apihelp-unblock-example-id','s:33:\"Unblock block ID #<kbd>105</kbd>.\";'),('en','messages:apihelp-unblock-example-user','s:61:\"Unblock user <kbd>Bob</kbd> with reason <kbd>Sorry Bob</kbd>.\";'),('en','messages:apihelp-undelete-description','s:281:\"Restore revisions of a deleted page.\n\nA list of deleted revisions (including timestamps) can be retrieved through [[Special:ApiHelp/query+deletedrevs|list=deletedrevs]], and a list of deleted file IDs can be retrieved through [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('en','messages:apihelp-undelete-param-title','s:29:\"Title of the page to restore.\";'),('en','messages:apihelp-undelete-param-reason','s:21:\"Reason for restoring.\";'),('en','messages:apihelp-undelete-param-timestamps','s:129:\"Timestamps of the revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('en','messages:apihelp-undelete-param-fileids','s:127:\"IDs of the file revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('en','messages:apihelp-undelete-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-undelete-example-page','s:35:\"Undelete page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-undelete-example-revisions','s:52:\"Undelete two revisions of page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-upload-description','s:600:\"Upload a file, or get the status of pending uploads.\n\nSeveral methods are available:\n* Upload file contents directly, using the <var>$1file</var> parameter.\n* Upload the file in pieces, using the <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var> parameters.* Have the MediaWiki server fetch a file from a URL, using the <var>$1url</var> parameter.\n* Complete an earlier upload that failed due to warnings, using the <var>$1filekey</var> parameter.\nNote that the HTTP POST must be done as a file upload (i.e. using <code>multipart/form-data</code>) when sending the <var>$1file</var>.\";'),('en','messages:apihelp-upload-param-filename','s:16:\"Target filename.\";'),('en','messages:apihelp-upload-param-comment','s:103:\"Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.\";'),('en','messages:apihelp-upload-param-text','s:32:\"Initial page text for new files.\";'),('en','messages:apihelp-upload-param-watch','s:15:\"Watch the page.\";'),('en','messages:apihelp-upload-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-upload-param-ignorewarnings','s:20:\"Ignore any warnings.\";'),('en','messages:apihelp-upload-param-file','s:14:\"File contents.\";'),('en','messages:apihelp-upload-param-url','s:27:\"URL to fetch the file from.\";'),('en','messages:apihelp-upload-param-filekey','s:67:\"Key that identifies a previous upload that was stashed temporarily.\";'),('en','messages:apihelp-upload-param-sessionkey','s:57:\"Same as $1filekey, maintained for backward compatibility.\";'),('en','messages:apihelp-upload-param-stash','s:90:\"If set, the server will stash the file temporarily instead of adding it to the repository.\";'),('en','messages:apihelp-upload-param-filesize','s:26:\"Filesize of entire upload.\";'),('en','messages:apihelp-upload-param-offset','s:25:\"Offset of chunk in bytes.\";'),('en','messages:apihelp-upload-param-chunk','s:15:\"Chunk contents.\";'),('en','messages:apihelp-upload-param-async','s:66:\"Make potentially large file operations asynchronous when possible.\";'),('en','messages:apihelp-upload-param-asyncdownload','s:33:\"Make fetching a URL asynchronous.\";'),('en','messages:apihelp-upload-param-leavemessage','s:76:\"If asyncdownload is used, leave a message on the user talk page if finished.\";'),('en','messages:apihelp-upload-param-statuskey','s:58:\"Fetch the upload status for this file key (upload by URL).\";'),('en','messages:apihelp-upload-param-checkstatus','s:52:\"Only fetch the upload status for the given file key.\";'),('en','messages:apihelp-upload-example-url','s:18:\"Upload from a URL.\";'),('en','messages:apihelp-upload-example-filekey','s:47:\"Complete an upload that failed due to warnings.\";'),('en','messages:apihelp-userrights-description','s:33:\"Change a user\'s group membership.\";'),('en','messages:apihelp-userrights-param-user','s:10:\"User name.\";'),('en','messages:apihelp-userrights-param-userid','s:8:\"User ID.\";'),('en','messages:apihelp-userrights-param-add','s:29:\"Add the user to these groups.\";'),('en','messages:apihelp-userrights-param-remove','s:34:\"Remove the user from these groups.\";'),('en','messages:apihelp-userrights-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-userrights-example-user','s:118:\"Add user <kbd>FooBot</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-example-userid','s:127:\"Add the user with ID <kbd>123</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-watch-description','s:54:\"Add or remove pages from the current user\'s watchlist.\";'),('en','messages:apihelp-watch-param-title','s:55:\"The page to (un)watch. Use <var>$1titles</var> instead.\";'),('en','messages:apihelp-watch-param-unwatch','s:54:\"If set the page will be unwatched rather than watched.\";'),('en','messages:apihelp-watch-example-watch','s:36:\"Watch the page <kbd>Main Page<