'),('en','messages:smw_smwadmin_setupsuccess','s:43:\"The storage engine was set up successfully.\";'),('en','messages:smw_smwadmin_return','s:12:\"Return to $1\";'),('en','messages:smw_smwadmin_updatestarted','s:203:\"A new update process for refreshing the semantic data was started.\nAll stored data will be rebuilt or repaired where needed.\nYou can follow the progress of the update on this special page.\n\nReturn to $1.\";'),('en','messages:smw_smwadmin_updatenotstarted','s:84:\"There is already an update process running.\nNot creating another one.\n\nReturn to $1.\";'),('en','messages:smw_smwadmin_updatestopped','s:63:\"All existing update processes have been stopped.\n\nReturn to $1.\";'),('en','messages:smw_smwadmin_updatenotstopped','s:119:\"To stop the running update process, you must activate the checkbox to indicate that you are really sure.\n\nReturn to $1.\";'),('en','messages:smw_smwadmin_docu','s:208:\"This special page helps you during installation and upgrade of <a href=\"https://www.semantic-mediawiki.org\">Semantic MediaWiki</a>.\nRemember to back up valuable data before executing administrative functions.\";'),('en','messages:smw_smwadmin_db','s:33:\"Database installation and upgrade\";'),('en','messages:smw_smwadmin_dbdocu','s:419:\"Semantic MediaWiki requires some extensions to the MediaWiki database in order to store the semantic data.\nThe below function ensures that your database is set up properly.\nThe changes made in this step do not affect the rest of the MediaWiki database, and can easily be undone if desired.\nThis setup function can be executed multiple times without doing any harm, but it is needed only once on installation or upgrade.\";'),('en','messages:smw_smwadmin_permissionswarn','s:414:\"If the operation fails with SQL errors, the database user employed by your wiki (check your LocalSettings.php) probably does not have sufficient permissions.\nEither grant this user additional permissions to create and delete tables, temporarily enter the login of your database root in LocalSettings.php, or use the maintenance script <code>setupStore.php</code>, which can use the credentials of an administrator.\";'),('en','messages:smw_smwadmin_dbbutton','s:28:\"Initialize or upgrade tables\";'),('en','messages:smw_smwadmin_announce','s:18:\"Announce your wiki\";'),('en','messages:smw_smwadmin_announce_text','s:119:\"If your wiki is public, you can register it on <a href=\"https://wikiapiary.com\">WikiApiary</a>, the wiki tracking wiki.\";'),('en','messages:smw_smwadmin_datarefresh','s:23:\"Data repair and upgrade\";'),('en','messages:smw_smwadmin_datarefreshdocu','s:450:\"It is possible to restore all Semantic MediaWiki data based on the current contents of the wiki.\nThis can be useful to repair broken data or to refresh the data if the internal format has changed due to some software upgrade.\nThe update is executed page by page and will not be completed immediately.\nThe following shows if an update is in progress and allows you to start or stop updates (unless this feature was disabled by the site administrator).\";'),('en','messages:smw_smwadmin_datarefreshprogress','s:428:\"<strong>An update is already in progress.</strong>\nIt is normal that the update progresses only slowly since it only refreshes data in small chunks each time a user accesses the wiki.\nTo finish this update more quickly, you can invoke the MediaWiki maintenance script <code>runJobs.php</code> (use the option <code>--maxjobs 1000</code> to restrict the number of updates done in one batch).\nEstimated progress of current update:\";'),('en','messages:smw_smwadmin_datarefreshbutton','s:19:\"Start updating data\";'),('en','messages:smw_smwadmin_datarefreshstop','s:16:\"Stop this update\";'),('en','messages:smw_smwadmin_datarefreshstopconfirm','s:29:\"Yes, I am {{GENDER:$1|sure}}.\";'),('en','messages:smw_smwadmin_support','s:15:\"Getting support\";'),('en','messages:smw_smwadmin_supportdocu','s:53:\"Various resources might help you in case of problems:\";'),('en','messages:smw_smwadmin_installfile','s:218:\"If you experience problems with your installation, start by checking the guidelines in the <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/blob/master/docs/INSTALL.md#smw-installation\">INSTALL file</a>.\";'),('en','messages:smw_smwadmin_smwhomepage','s:139:\"The complete user documentation to Semantic MediaWiki is at <b><a href=\"https://www.semantic-mediawiki.org\">semantic-mediawiki.org</a></b>.\";'),('en','messages:smw_smwadmin_mediazilla','s:107:\"Bugs can be reported to <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/issues\">GitHub</a>.\";'),('en','messages:smw_smwadmin_questions','s:186:\"If you have further questions or suggestions, join the discussion on <a href=\"http://sourceforge.net/mailarchive/forum.php?forum_name=semediawiki-user\">Semantic MediaWiki user forum</a>.\";'),('en','messages:smw_adminlinks_datastructure','s:14:\"Data structure\";'),('en','messages:smw_adminlinks_displayingdata','s:12:\"Data display\";'),('en','messages:smw_adminlinks_inlinequerieshelp','s:19:\"Inline queries help\";'),('en','messages:smw-page-indicator-usage-count','s:113:\"Estimated [https://www.semantic-mediawiki.org/wiki/Help:Property_usage_count usage count]: {{PLURAL:$2|\'\'\'$2\'\'\'}}\";'),('en','messages:smw-page-indicator-type-info','s:25:\"{{PLURAL:$1|User|System}}\";'),('en','messages:smw-createproperty-isproperty','s:28:\"It is a property of type $1.\";'),('en','messages:smw-createproperty-allowedvals','s:82:\"The allowed {{PLURAL:$1|value for this property is|values for this property are}}:\";'),('en','messages:smw-paramdesc-category-delim','s:13:\"The delimiter\";'),('en','messages:smw-paramdesc-category-template','s:35:\"A template to format the items with\";'),('en','messages:smw-paramdesc-category-userparam','s:35:\"A parameter to pass to the template\";'),('en','messages:smw-info-par-message','s:19:\"Message to display.\";'),('en','messages:smw