,('en','messages:right-smw-patternedit','s:85:\"Edit access to maintain allowed regular expressions and patterns (Semantic MediaWiki)\";'),('en','messages:action-smw-patternedit','s:51:\"edit regular expressions used by Semantic MediaWiki\";'),('en','messages:group-smwadministrator','s:35:\"Administrators (Semantic MediaWiki)\";'),('en','messages:group-smwadministrator-member','s:48:\"{{GENDER:$1|administrator (Semantic MediaWiki)}}\";'),('en','messages:grouppage-smwadministrator','s:50:\"{{ns:project}}:Administrators (Semantic MediaWiki)\";'),('en','messages:group-smwcurator','s:29:\"Curators (Semantic MediaWiki)\";'),('en','messages:group-smwcurator-member','s:42:\"{{GENDER:$1|curator (Semantic MediaWiki)}}\";'),('en','messages:grouppage-smwcurator','s:44:\"{{ns:project}}:Curators (Semantic MediaWiki)\";'),('en','messages:action-smw-admin','s:46:\"access Semantic MediaWiki administration tasks\";'),('en','messages:smw-pa-property-predefined-default','s:30:\"\"$1\" is a predefined property.\";'),('en','messages:smw-pa-property-predefined-common','s:290:\"This property is pre-deployed (also known as [https://www.semantic-mediawiki.org/wiki/Help:Special_properties special property]) and comes with additional administrative privileges but can be used just like any other [https://www.semantic-mediawiki.org/wiki/Property user-defined property].\";'),('en','messages:smw-pa-property-predefined_ask','s:269:\"\"$1\" is a predefined property that represents meta information (in form of a [https://www.semantic-mediawiki.org/wiki/Subobject subobject]) about individual queries and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_asksi','s:189:\"\"$1\" is a predefined property that collects the number of conditions used in a query and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_askde','s:397:\"\"$1\" is a predefined property that informs about the depth (numerical value computed on the basis of subquery nesting and resolved property chains) of a query while query execution is being restricted by the [https://www.semantic-mediawiki.org/wiki/Help:$smwgQMaxDepth $smwgQMaxDepth] setting and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-sp-properties-docu','s:453:\"This page lists [https://www.semantic-mediawiki.org/wiki/Property properties] and its usage count available for this wiki. For an up-to-date count statistics it is recommended that the [https://www.semantic-mediawiki.org/wiki/rebuildPropertyStatistics property statistics] maintenance script is run on a regular basis. For a differentiated view, see the [[Special:UnusedProperties|unused]] or [[Special:WantedProperties|wanted properties]] special page.\";'),('en','messages:smw-sp-properties-cache-info','s:123:\"The listed data have been retrieved from [https://www.semantic-mediawiki.org/wiki/Caching cache], and were last updated $1.\";'),('en','messages:smw-sp-properties-header-label','s:18:\"List of properties\";'),('en','messages:smw-sp-admin-settings-title','s:22:\"Configuration settings\";'),('en','messages:smw-sp-admin-settings-docu','s:251:\"Displays a list of all default and localized settings that are relevant to the Semantic MediaWiki environment. For details on individual settings, please consult the [https://www.semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),('en','messages:smw-sp-admin-settings-button','s:22:\"Generate settings list\";'),('en','messages:smw-sp-admin-idlookup-title','s:16:\"Object ID lookup\";'),('en','messages:smw-sp-admin-idlookup-docu','s:131:\"Displays details about an internal object ID that represents individual entities (wikipage, subobject, etc.) in Semantic MediaWiki.\";'),('en','messages:smw-sp-admin-iddispose-title','s:18:\"Object ID disposal\";'),('en','messages:smw-sp-admin-iddispose-docu','s:278:\"The disposal operation is unrestricted and will remove an internal object ID from the storage engine, if confirmed. Please perform this task with \'\'\'caution\'\'\' and only after the [https://www.semantic-mediawiki.org/wiki/Help:Object_ID_disposal documentation] has been consulted.\";'),('en','messages:smw-sp-admin-iddispose-done','s:45:\"ID \"$1\" was removed from the storage backend.\";'),('en','messages:smw-sp-admin-objectid','s:10:\"Object ID:\";'),('en','messages:smw-livepreview-loading','s:10:\"Loading...\";'),('en','messages:smw-sp-searchbyproperty-description','s:313:\"This page provides a simple [https://www.semantic-mediawiki.org/wiki/Help:Browsing_interfaces browsing interface] for finding entities described by a property and a named value. Other available search interfaces include the [[Special:PageProperty|page property search]], and the [[Special:Ask|ask query builder]].\";'),('en','messages:smw-sp-searchbyproperty-resultlist-header','s:15:\"List of results\";'),('en','messages:smw-sp-searchbyproperty-nonvaluequery','s:54:\"A list of values that have the property \"$1\" assigned.\";'),('en','messages:smw-sp-searchbyproperty-valuequery','s:66:\"A list of pages that have property \"$1\" with value \"$2\" annotated.\";'),('en','messages:smw-datavalue-number-textnotallowed','s:65:\"\"$1\" can not be assigned to a declared number type with value $2.\";'),('en','messages:smw-datavalue-number-nullnotallowed','s:59:\"\"$1\" returned with a \"NULL\" which is not allowed as number.\";'),('en','messages:smw-editpage-annotation-enabled','s:558:\"This page supports semantic in-text annotations (e.g. <nowiki>\"[[Is specified as::World Heritage Site]]\"</nowiki>) to build structured and queryable content provided by Semantic MediaWiki. For a comprehensive description on how to use annotations or the #ask parser function, please have a look at the [https://www.semantic-mediawiki.org/wiki/Help:Getting_started getting started], [https://www.semantic-mediawiki.org/wiki/Help:In-text_annotation in-text annotation], or [https://www.semantic-mediawiki.org/wiki/Help:Inline_queries inline queries] help page.\";'),('en','messages:smw-editpage-annotation-disabled','s:236:\"This page is not enabled for semantic in-text annotations due to namespace restrictions. Details about how to enable the namespace is described on the [https://www.semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),('en','messages:smw-editpage-property-annotation-enabled','s:472:\"This property can be extended using semantic annotations to specify a datatype (e.g. <nowiki>\"[[Has type::Page]]\"</nowiki>) or other supporting declarations (e.g. <nowiki>\"[[Subproperty of::dc:date]]\"</nowiki>). For a description on how to augment this page, see the [https://www.semantic-mediawiki.org/wiki/Help:Property_declaration declaration of a property] or the [https://www.semantic-mediawiki.org/wiki/Help:List_of_datatypes list of available data types] help page.\";'),('en','messages:smw-editpage-property-annotation-disabled','s:259:\"This property cannot be extended with a datatype annotation (e.g. <nowiki>\"[[Has type::Page]]\"</nowiki>) as it is already predefined (see the [https://www.semantic-mediawiki.org/wiki/Help:Special_properties special properties] help page for more information).\";'),('en','messages:smw-editpage-concept-annotation-enabled','s:189:\"This concept can be extended using the #concept parser function. For a description on how to use #concept, see the [https://www.semantic-mediawiki.org/wiki/Help:Concepts concept] help page.\";'),('en','messages:log-name-smw','s:22:\"Semantic MediaWiki log\";'),('en','messages:log-show-hide-smw','s:25:\"$1 Semantic MediaWiki log\";'),('en','messages:log-description-smw','s:155:\"Activities for [https://www.semantic-mediawiki.org/wiki/Help:Logging enabled event types] that have been reported by Semantic MediaWiki and its components.\";'),('en','messages:logentry-smw-maintenance','s:56:\"Maintenance related events emitted by Semantic MediaWiki\";'),('en','messages:smw-datavalue-import-unknownns','s:121:\"The import namespace \"$1\" is unknown. Please ensure that OWL import details are available via [[MediaWiki:Smw import $1]]\";'),('en','messages:smw-datavalue-import-missing-nsuri','s:81:\"Unable to find a \"$1\" namespace URI in the [[MediaWiki:Smw import $1|$1 import]].\";'),('en','messages:smw-datavalue-import-missing-type','s:83:\"No type definition was found for \"$1\" in the [[MediaWiki:Smw import $2|$2 import]].\";'),('en','messages:smw-datavalue-import-link','s:37:\"[[MediaWiki:Smw import $1|$1 import]]\";'),('en','messages:smw-datavalue-import-invalidvalue','s:102:\"\"$1\" is not a valid format and is expected to consists of \"namespace\":\"identifier\" (e.g. \"foaf:name\").\";'),('en','messages:smw-pa-property-predefined_impo','s:251:\"\"$1\" is a predefined property that describes a relation to an [https://www.semantic-mediawiki.org/wiki/Help:Import_vocabulary imported vocabulary] and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_type','s:194:\"\"$1\" is a predefined property that describes the [[Special:Types|datatype]] of a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_sobj','s:226:\"\"$1\" is a predefined property representing a [https://www.semantic-mediawiki.org/wiki/Help:Container container] construct and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined-long_sobj','s:180:\"The container allows to accumulate property-value assignments similar to that of a normal wiki page but within a different entity space while being linked to the embedding subject.\";'),('en','messages: