smw-pa-property-predefined_mdat','s:201:\"\"$1\" is a predefined property that corresponds to the date of the last modification of a subject and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_cdat','s:198:\"\"$1\" is a predefined property that corresponds to the date of the first revision of a subject and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_newp','s:181:\"\"$1\" is a predefined property is indicating whether a subject is new nor not and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_ledt','s:204:\"\"$1\" is a predefined property that contains the page name of the user who created the last revision and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_mime','s:183:\"\"$1\" is a predefined property that describes the MIME type of an uploaded file and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_media','s:184:\"\"$1\" is a predefined property that describes the media type of an uploaded file and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_askfo','s:191:\"\"$1\" is a predefined property that holds the name of the result format used in a query and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_askst','s:189:\"\"$1\" is a predefined property that describes the conditions of the query as a string and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_askdu','s:220:\"\"$1\" is a predefined property containing a time value (in seconds) the query had required to complete its execution and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_prec','s:172:\"\"$1\" is a predefined property that describes a [https://www.semantic-mediawiki.org/wiki/Help:Display_precision display precision] (in decimal digits) for numeric datatypes.\";'),('en','messages:smw-sp-types-geo-not-available','s:143:\"[https://www.semantic-mediawiki.org/wiki/Semantic_Maps Semantic Maps] was not detected therefore \"$1\" is restricted in its capacity to operate.\";'),('en','messages:smw-datavalue-monolingual-dataitem-missing','s:70:\"An expected item for building a monolingual compound value is missing.\";'),('en','messages:smw-datavalue-monolingual-lcode-parenthesis','s:4:\"($1)\";'),('en','messages:smw-datavalue-languagecode-missing','s:92:\"For the \"$1\" annotation, the parser was unable to determine a language code (i.e. \"foo@en\").\";'),('en','messages:smw-datavalue-languagecode-invalid','s:53:\"\"$1\" was not recognized as a supported language code.\";'),('en','messages:smw-pa-property-predefined_lcode','s:182:\"\"$1\" is a predefined property that represents a BCP47 formatted language code and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-sp-types_mlt_rec','s:172:\"\"$1\" is a [https://www.semantic-mediawiki.org/wiki/Help:Container container] datatype that associates a text value with a specific [[Property:Language code|language code]].\";'),('en','messages:smw-sp-types-mlt-lcode','s:203:\"The datatype does {{PLURAL:$2|require|not require}} a language code (i.e. {{PLURAL:$2|a value annotation without a language code is not accepted|a value annotation without a language code is 