d on this wiki.\";'),('en','messages:smw-pa-property-predefined_pvap','s:292:\"\"$1\" is a predefined property that can specify a [[MediaWiki:Smw allows pattern|pattern reference]] to apply [https://en.wikipedia.org/wiki/Regular_expression regular expression] matching and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_dtitle','s:188:\"\"$1\" is a predefined property that can assign a distinct display title to an entity and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_pvuc','s:208:\"\"$1\" is a predefined property indicating that value assignments to a property are expected to be unique and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined-long_pvuc','s:154:\"Uniqueness is established when two values are not equal in their literal representation and any violation of this constraint will be categorized as error.\";'),('en','messages:smw-datavalue-uniqueness-constraint-error','s:101:\"Property \"$1\" only permits unique value assignments and \'\'$2\'\' was already annotated in subject \"$3\".\";'),('en','messages:smw-pa-property-predefined_boo','s:190:\"\"$1\" is a [[Special:Types/Boolean|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent boolean values.\";'),('en','messages:smw-pa-property-predefined_num','s:189:\"\"$1\" is a [[Special:Types/Number|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent numeric values.\";'),('en','messages:smw-pa-property-predefined_dat','s:184:\"\"$1\" is a [[Special:Types/Date|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent date values.\";'),('en','messages:smw-pa-property-predefined_uri','s:186:\"\"$1\" is a [[Special:Types/URL|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent URI/URL values.\";'),('en','messages:smw-pa-property-predefined_qty','s:192:\"\"$1\" is a [[Special:Types/Quantity|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent quantity values.\";'),('en','messages:numeralpha-desc','s:77:\"Provides an incremental tag with zero padded numbers, roman and alpha numbers\";'),('en','messages:ext-numeralpha-list-type-numeral','s:7:\"numeral\";'),('en','messages:ext-numeralpha-list-type-alpha','s:5:\"alpha\";'),('en','messages:ext-numeralpha-list-type-roman','s:5:\"roman\";'),('en','messages:ext-numeralpha-list-type-label','s:4:\"type\";'),('en','messages:ext-numeralpha-list-set-label','s:3:\"set\";'),('en','messages:ext-numeralpha-list-pad-length','s:10:\"pad length\";'),('en','messages:ext-numeralpha-list-pad-char','s:13:\"pad character\";'),('en','messages:ext-numeralpha-list-prefix','s:6:\"prefix\";'),('en','messages:ext-numeralpha-list-suffix','s:6:\"suffix\";'),('en','messages:maps-desc','s:107:\"Enables embedding of dynamic maps into wiki pages, geocoding of addresses and other geographical operations\";'),('en','messages:right-geocode','s:7:\"Geocode\";'),('en','messages:action-geocode','s:25:\"do geocoding on this wiki\";'),('en','messages:maps_map','s:3:\"Map\";'),('en','messages:maps-tracking-category','s:47:\"Pages with a map rendered by the Maps extension\";'),('en','messages:maps-loading-map','s:14:\"Loading map...\";'),('en','messages:maps-load-failed','s:23:\"Could not load the map!\";'),('en','messages:maps-markers','s:7:\"Markers\";'),('en','messages:maps-copycoords-prompt','s:13:\"CTRL+C, ENTER\";'),('en','messages:maps-searchmarkers-text','s:14:\"Filter markers\";'),('en','messages:maps-others','s:6:\"others\";'),('en','messages:maps-kml-parsing-failed','s:105:\"Failed parsing one or more KML files. Usually this happens because of retrieval failure or malformed XML.\";'),('en','messages:maps-ns-layer','s:5:\"Layer\";'),('en','messages:maps-ns-layer-talk','s:10:\"Layer talk\";'),('en','messages:maps-layer-property','s:8:\"Property\";'),('en','messages:maps-layer-value','s:5:\"Value\";'),('en','messages:maps-layer-errors','s:6:\"Errors\";'),('en','messages:maps-layerdef-invalid','s:44:\"Invalid {{PLURAL:$1|definition|definitions}}\";'),('en','messages:maps-layerdef-invalid-fatal','s:24:\"Fatal invalid definition\";'),('en','messages:maps-layerdef-wrong-namespace','s:59:\"Layer definitions are only valid on pages of namespace \"$1\"\";'),('en','messages:maps-layerdef-equal-layer-name','s:99:\"Layer names must be unique within the same layer page. \"$1\" is already being used by another layer.\";'),('en','messages:maps-layerpage-usage','s:32:\"Pages with maps using layer \"$1\"\";'),('en','messages:maps-layerpage-nousage','s:44:\"No pages are using this layer at the moment.\";'),('en','messages:maps-error-invalid-layertype','s:95:\"There are no layers of type \"$1\". Only {{PLURAL:$3|this type is|these types are}} supported: $2\";'),('en','messages:maps-error-no-layertype','s:97:\"You need to specify the layer type. {{PLURAL:$2|Only this type is|These types are}} supported: $1\";'),('en','messages:validation-error-invalid-layer','s:37:\"Parameter \"$1\" must be a valid layer.\";'),('en','messages:validation-error-invalid-layers','s:48:\"Parameter \"$1\" must be one or more valid layers.\";'),('en','messages:validation-error-no-non-numeric','s:44:\"Parameter \"$1\" must be a non-numeric string.\";'),('en','messages:validation-error-no-non-numerics','s:55:\"Parameter \"$1\" must be one or more non-numeric strings.\";'),('en','messages:maps-layer-of-type','s:18:\"Layer of type \"$1\"\";'),('en','messages:maps-layer-of-type-and-name','s:23:\"Layer \"$2\" of type \"$1\"\";'),('en','messages:maps-layer-type-supported-by','s:115:\"This layer type can {{PLURAL:$2|only be used with the $1 mapping service|be used with these mapping services: $1}}.\";'),('en','messages:maps-coordinates-description','s:76:\"Parser hook to format coordinates, from and to any of the supported formats.\";'),('en','messages:maps-displaymap-description','s:67:\"Display geographical maps without any wiki-defined markers on them.\";'),('en','messages:maps-distance-description','s:87:\"Convert a distance using a certain supported unit to its equivalent using another unit.\";'),('en','messages:maps-finddestination-description','s:123:\"Find a destination given a starting point (that can be in any of the supported formats), an initial bearing and a distance.\";'),('en','messages:maps-geocode-description','s:211:\"Enables the geocoding of addresses, in other words, turning human readable locations into sets of coordinates. There is support for several geocoding services, which should not be confused with mapping services.\";'),('en','messages:maps-geodistance-description','s:97:\"Calculate the geographical distance between two points, from and to any of the supported formats.\";'),('en','messages:maps-mapsdoc-description','s:120:\"Display a table with the parameters for a specified mapping service together with their default values and descriptions.\";'),('en','messages:maps-layerdefinition-description','s:73:\"Describes a custom layer which can be displayed with other Map functions.\";'),('en','messages:maps-mapsdoc-par-service','s:59:\"The mapping service to display parameter documentation for.\";'),('en','messages:maps-mapsdoc-par-language','s:118:\"The language in which to display the documentation. If no such translation is available, English will be used instead.\";'),('en','messages:maps-coordinates-par-location','s:35:\"The coordinates you want to format.\";'),('en','messages:maps-coor